(4, 4, 1, 'Something to write about!', 'Proin auctor consectetur ex, eget ultricies tortor lobortis porta. Morbi nunc risus, commodo a ultricies ac, dictum quis mauris. Ut facilisis viverra scelerisque. Suspendisse lacinia orci in tellus interdum vehicula. Maecenas iaculis enim at tortor fermentum, nec cursus nisl facilisis. '),
(7, 5, 1, 'We love to taste new things!', 'Ut consectetur faucibus justo, eu tristique diam auctor et. Phasellus vitae semper nulla. Sed nisl elit, vulputate sed velit nec, gravida pharetra quam. Aenean mattis neque ut urna maximus, at suscipit lorem ultrices. Fusce felis ex, pulvinar at neque ut, faucibus rutrum mauris. Vivamus cursus enim id tortor porta malesuada.');
