INSERT INTO `page_contents` (`id`, `page_id`, `language_id`, `title`, `content`) VALUES
(1, 1, 1, 'About Us', '\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Founded and established in 2018, Hoocay.com is a Malaysian local travel convenience that provide information and service for travellers who are looking for places to stay. Inspired by the beauty vacation sites in Malaysia, Hoocay.com trying to encourage non-hotel accommodation industry to become popular choice of travellers from all around the world. By bringing the industry available on-line mode, Hoocay, through its platform, offers information such as price, reviews, photos, booking and other related travel services. While trying to provide travellers with great but low cost travel experience, Hoocay also giving everyone the chances to become hosts and opportunity for them to market their accommodation facilities that will boost their income. <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;<b>Appscraft Sdn Bhd (1278150M)&nbsp;</b>is a full-service Digital Marketing firm founded by <b>Muhammad Muzaffa</b>r and Co. The idea behind creating this company was to assist businesses, especially small businesses to market their services, products and ideas in a more simpler way by considering and connecting all the relevant digital routes. With knowledge and well-experienced in managing the digital properties and online marketing, later on providing us with solid background to form this company. Our operation-based approach and futuristic thinking capabilities make us to consider about current business community much deeper and try to provide them with tailor-made solutions to meet their business objectives. Our strong understanding of basic principles of marketing and our competency to adapt to the changes over time make us able to carry this aspiration. We dream to bring much significant and meaningful values for each invested money spent in terms of increasing production, well organizing, better marketing, higher brand visibility, and also enhancing sales and engagement. We understand the needs of our clients and try to create strategies to help them acquire a bigger success with their business. <b>Appscraft Sdn Bhd&nbsp;</b>currently provides Digital Marketing services to its local clients but will not rule out the possibility to enter global market and operate internationally. As for now, we compose customized strategies for all of our clients as we believe that each business is different and needs special attention to make the process successful. Our team consist of knowledgeable team member who have solid basics in attending the<br>customer requirement.<br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Along with the services, we are also working on to develop our own few products to help our customers get better understanding and confidence in our business style. Once familiar, clients will be able to automate the marketing process for better control and reduced costs of time, money and efforts.</p>\n');
INSERT INTO `page_contents` (`id`, `page_id`, `language_id`, `title`, `content`) VALUES
(4, 2, 1, 'Terms and conditions', '\n<h1><b>Hoocay Guest Refund Policy</b></h1><p><br>Last Updated: August 7, 2017<br><br>These terms and conditions govern Hoocay&rsquo;s policy for Guest refunds (&ldquo;Guest Refund Policy&rdquo;) and the obligations of the Host associated with the Guest Refund Policy. The Guest Refund Policy applies in addition to Hoocay&rsquo;s Terms of Service (&ldquo;Hoocay Terms&rdquo;). The Guest Refund Policy is available to Guests who book and pay for an Accommodation through the Hoocay Platform and suffer a Travel Issue (as defined below). The Guest&rsquo;s rights under this Guest Refund Policy will supersede the Host&rsquo;s cancellation policy.<br><br>All capitalized terms shall have the meaning set forth in the Hoocay Terms or Payments Terms unless otherwise defined in this Guest Refund Policy.<br><br>By using the Hoocay Platform as a Host or Guest, you are indicating that you have read and that you understand and agree to be bound by this Guest Refund Policy.<br><br>1.&nbsp;&nbsp; &nbsp;Travel Issue<br><br>A &ldquo;Travel Issue&rdquo; means any one of the following:<br><br>(a)&nbsp;&nbsp; &nbsp;the Host of the Accommodation (i) cancels a booking shortly before the scheduled start of the booking, or (ii) fails to provide the Guest with the reasonable ability to access the Accommodation (e.g. does not provide the keys and/or a security code).<br><br>(b)&nbsp;&nbsp; &nbsp;the Listing&rsquo;s description or depiction of the Accommodation is materially inaccurate with respect to:<br><br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the size of the Accommodation (e.g., number and size of the bedroom, bathroom and/or kitchen or other rooms),<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; whether the booking for the Accommodation is for an entire home, private room or shared room, and whether another party, including the Host, is staying at the Accommodation during the booking,<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; special amenities or features represented in the Listing are not provided or do not function, such as decks, pools, hot tubs, bathrooms (toilet/shower/bathtub), kitchen (sink/stove/refrigerator or major other appliances), and electrical, heating or air condition systems, or<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the physical location of the Accommodation (proximity)<br><br>(c)&nbsp;&nbsp; &nbsp;at the start of the Guest&rsquo;s booking, the Accommodation: (i) is not generally clean and sanitary (ii) contains safety or health hazards that would be reasonably expected to adversely affect the Guest&rsquo;s stay at the Accommodation in Hoocay&rsquo;s judgment, (iii) does not contain clean bedding and bathroom towels available for the Guest&rsquo;s use, or (iv) has vermin or contains pets not disclosed in the Listing.<br><br>2.&nbsp;&nbsp; &nbsp;The Guest Refund Policy<br><br>If you are a Guest and suffer a Travel Issue, we agree, at our discretion, to either (i) reimburse you up to the amount paid by you through the Hoocay Platform (&ldquo;Total Fees&rdquo;) depending on the nature of the Travel Issue suffered, or (ii) use our reasonable efforts to find and book you another Accommodation for any unused nights left in your booking which is reasonably comparable to the Accommodation described in your original booking in terms of size, rooms, features and quality. All determinations of Hoocay with respect to the Guest Refund Policy, including without limitation the size of any refund and the comparability of alternate Accommodations, shall be in Hoocay&rsquo;s discretion, and final and binding on the Guests and Hosts.<br><br>3.&nbsp;&nbsp; &nbsp;Conditions to Claim a Travel Issue<br><br>To submit a valid claim for a Travel Issue and receive the benefits with respect to your booking, you are required to meet each of the following conditions:<br>(a) you must be the Guest that booked the Accommodation;<br>(b) you must bring the Travel Issue to our attention in writing or via telephone and provide us with information (including photographs or other evidence) about the Accommodation and the circumstances of the Travel Issue within 24 hours after the later of (i) the start of your booking or (ii) you discover the existence of the Travel Issue , and must respond to any requests by us for additional information or cooperation on the Travel Issue;<br>(c) you must not have directly or indirectly caused the Travel Issue (through your action, omission or negligence); and<br>(d) unless Hoocay advises you that the Travel Issue cannot be remediated, you must have used reasonable efforts to try to remedy the circumstances of the Travel Issue with the Host prior to making a claim for a Travel Issue.<br><br>4.&nbsp;&nbsp; &nbsp;Minimum Quality Standards, Host Responsibilities and Reimbursement to Guest<br><br>4.1&nbsp;&nbsp; &nbsp;If you are a Host, you are responsible for ensuring that the Accommodations you list on the Hoocay Platform meet minimum quality standards regarding access, adequacy of the Listing description, safety, cleanliness, and do not present a Guest with Travel Issues. During a Guest&rsquo;s stay at an Accommodation, Hosts should be available, or make a third-party available, in order to try, in good faith, to resolve any Guest issues.<br><br>4.2&nbsp;&nbsp; &nbsp;If you are a Host, and if (i) Hoocay determines that a Guest has suffered a Travel Issue related to an Accommodation listed by you and (ii) Hoocay either reimburses that Guest (up to their Total Fees) or provides an alternative Accommodation to the Guest, you agree to reimburse Hoocay up to the amount paid by Hoocay within 30 days of Hoocay&rsquo;s request. If the Guest is relocated to an alternative Accommodation, you also agree to reimburse Hoocay for reasonable additional costs incurred to relocate the Guest. You authorize Hoocay Payments to collect any amounts owed to Hoocay by reducing your Payout or as otherwise permitted pursuant to the Payments Terms.<br><br><br>4.3&nbsp;&nbsp; &nbsp;As a Host, you understand that the rights of Guests under this Guest Refund Policy will supersede your selected cancellation policy. If you dispute the Travel Issue, you may notify us in writing or via telephone and provide us with information (including photographs or other evidence) disputing the claims regarding the Travel Issue, provided you must have used reasonable and good faith efforts to try to remedy the Travel Issue with the Guest prior to disputing the Travel Issue claim.<br><br><br>5.&nbsp;&nbsp; &nbsp;General Provisions<br><br>5.1&nbsp;&nbsp; &nbsp;Modification or Termination. Hoocay reserves the right to modify or terminate this Guest Refund Policy, at any time, in its sole discretion. If Hoocay modifies this Guest Refund Policy, we will post the modification on the Hoocay Platform or provide you with notice of the modification and Hoocay will continue to process all claims for Travel Issues made prior to the effective date of the modification.<br><br>5.2&nbsp;&nbsp; &nbsp;Entire Agreement. This Guest Refund Policy constitutes the entire and exclusive understanding and agreement between Hoocay and you regarding the Guest Refund Policy and supersedes and replaces any and all prior oral or written understandings or agreements between Hoocay and you regarding the Guest Refund Policy.<br><br><br>6. Contacting Hoocay. If you have any questions about the Guest Refund Policy, please email us.<br></p><p><br></p><p>Nondiscrimination Policy<br><br>Our Commitment to Inclusion and Respect<br><br>We are all committed to doing everything we can to help eliminate all forms of unlawful bias, discrimination, and intolerance from our platform. We want to promote a culture within the Hoocay community&mdash;hosts, guests and people just considering whether to use our platform&mdash;that goes above and beyond mere compliance. To that end, all of us, Hoocay employees, hosts and guests alike, agree to read and act in accordance with the following policy to strengthen our community and realize our mission of ensuring that everyone can belong, and feels welcome, anywhere.<br><br>&bull;&nbsp;&nbsp; &nbsp;Inclusion &ndash; We welcome guests of all backgrounds with authentic hospitality and open minds. Joining Hoocay, as a host or guest, means becoming part of a community of inclusion. Bias, prejudice, racism, and hatred have no place on our platform or in our community. While hosts are required to follow all applicable laws that prohibit discrimination based on such factors as race, religion, national origin, and others listed below, we commit to do more than comply with the minimum requirements established by law.<br><br>&bull;&nbsp;&nbsp; &nbsp;Respect &ndash; We are respectful of each other in our interactions and encounters. Hoocay appreciates that local laws and cultural norms vary around the world and expects hosts and guests to abide by local laws, and to engage with each other respectfully, even when views may not reflect their beliefs or upbringings. Hoocay&rsquo;s members bring to our community an incredible diversity of background experiences, beliefs, and customs. By connecting people from different backgrounds, Hoocay fosters greater understanding and appreciation for the common characteristics shared by all human beings and undermines prejudice rooted in misconception, misinformation, or misunderstanding.<br><br><br><br><br>Race, Color, Ethnicity, National Origin, Religion, Sexual Orientation, Gender Identity, or Marital Status<br><br>&bull;&nbsp;&nbsp; &nbsp;Hoocay hosts may not:<br><br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Decline a guest based on race, color, ethnicity, national origin, religion, sexual orientation, gender identity, or marital status.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Impose any different terms or conditions based on race, color, ethnicity, national origin, religion, sexual orientation, gender identity, or marital status.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Post any listing or make any statement that discourages or indicates a preference for or against any guest on account of race, color, ethnicity, national origin, religion, sexual orientation, gender identity, or marital status.<br><br>Gender<br>&bull;&nbsp;&nbsp; &nbsp;Hoocay hosts may not:<br><br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Decline to rent to a guest based on gender unless the host shares living spaces (for example, bathroom, kitchen, or common areas) with the guest.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Impose any different terms or conditions based on gender unless the host shares living spaces with the guest.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Post any listing or make any statement that discourages or indicates a preference for or against any guest on account of gender, unless the host shares living spaces with the guest.<br><br>&bull;&nbsp;&nbsp; &nbsp;Hoocay hosts may:<br><br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Make a unit available to guests of the host&rsquo;s gender and not the other, where the host shares living spaces with the guest.<br><br>Disability<br>&bull;&nbsp;&nbsp; &nbsp;Hoocay hosts may not:<br><br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Decline a guest based on any actual or perceived disability.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Impose any different terms or conditions based on the fact that the guest has a disability.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Substitute their own judgment about whether a unit meets the needs of a guest with a disability for that of the prospective guest.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Inquire about the existence or severity of a guest&rsquo;s disability, or the means used to accommodate any disability. If, however, a potential guest raises his or her disability, a host may, and should, discuss with the potential guest whether the listing meets the potential guest&rsquo;s needs.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Prohibit or limit the use of mobility devices.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Charge more in rent or other fees for guests with disabilities.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Post any listing or make any statement that discourages or indicates a preference for or against any guest on account of the fact that the guest has a disability.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Refuse to communicate with guests through accessible means that are available, including relay operators (for people with hearing impairments) and e-mail (for people with vision impairments using screen readers).<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Refuse to provide reasonable accommodations, including flexibility when guests with disabilities request modest changes in your house rules, such as bringing an assistance animal that is necessary because of the disability, or using an available parking space near the unit. When a guest requests such an accommodation, the host and the guest should engage in a dialogue to explore mutually agreeable ways to ensure the unit meets the guest&rsquo;s needs.<br><br>&bull;&nbsp;&nbsp; &nbsp;Hoocay hosts may:<br><br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Provide factually accurate information about the unit&rsquo;s accessibility features (or lack of them), allowing for guests with disabilities to assess for themselves whether the unit is appropriate to their individual needs.<br>&#9702;&nbsp;&nbsp; &nbsp;<br>Personal Preferences<br><br>&bull;&nbsp;&nbsp; &nbsp;Hoocay hosts may:<br><br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Except as noted above, Hoocay hosts may decline to rent based on factors that are not prohibited by law. For example, except where prohibited by law, Hoocay hosts may decline to rent guests with pets, or to guests who smoke.<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Require guests to respect restrictions on foods consumed in the listing (e.g., a host who maintains a Kosher or vegetarian kitchen may require guests to respect those restrictions).<br>&#9702;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nothing in this policy prevents a host from turning down a guest on the basis of a characteristic that is not protected under the civil rights laws or closely associated with a protected class. For example, an Hoocay host may turn down a guest who wants to smoke in a unit, or place limits on the number of guests in a unit.<br><br>When guests are turned down. Hosts should keep in mind that no one likes to be turned down. While a host may have, and articulate, lawful and legitimate reasons for turning down a potential guest, it may cause that member of our community to feel unwelcome or excluded. Hosts should make every effort to be welcoming to guests of all backgrounds. Hosts who demonstrate a pattern of rejecting guests from a protected class (even while articulating legitimate reasons), undermine the strength of our community by making potential guests feel unwelcome, and Hoocay may suspend hosts who have demonstrated such a pattern from the Hoocay platform.<br><br>Some countries or communities may allow or even require people to make accommodation distinctions based on, for example, marital status, national origin, gender or sexual orientation, in violation of our general nondiscrimination philosophy. In these cases, we do not require hosts to violate local laws, nor to accept guests that could expose the hosts to a real and demonstrable risk of arrest, or physical harm to their persons or property. Hosts who live in such areas should set out any such restriction on their ability to host particular guests in their listing, so that prospective guests are aware of the issue and Hoocay can confirm the necessity for such an action. In communicating any such restrictions, we expect hosts to use clear, factual, non-derogatory terms. Slurs and insults have no place on our platform or in our community.<br><br>What happens when a host does not comply with our policies in this area?<br>If a particular listing contains language contrary to this nondiscrimination policy, the host will be asked to remove the language and affirm his or her understanding and intent to comply with this policy and its underlying principles. Hoocay may also, in its discretion, take steps up to and including suspending the host from the Hoocay platform.<br>If the host improperly rejects guests on the basis of protected class, or uses language demonstrating that his or her actions were motivated by factors prohibited by this policy, Hoocay will take steps to enforce this policy, up to and including suspending the host from the platform.<br>As the Hoocay community grows, we will continue to ensure that Hoocay&rsquo;s policies and practices align with our most important goal: To ensure that guests and hosts feel welcome and respected in all of their interactions using the Hoocay platform. The public, our community, and we ourselves, expect no less than this.<br><br>Payments Terms of Service<br>Please read these Payments Terms of Service carefully as they contain important information about your legal rights, remedies and obligations. By using the Payment Services, you agree to comply with and be bound by these Payments Terms of Service.<br><br>Please note: Section 22 of these Payments Terms of Service contains an arbitration clause and class action waiver that applies to all Hoocay Members. By accepting these Payments Terms of Service, you agree to be bound by this arbitration clause and class action waiver. Please read it carefully.<br><br>Last Updated: April 16, 2018<br><br>These Payments Terms of Service (&ldquo;Payments Terms&rdquo;) constitute a legally binding agreement (&ldquo;Agreement&rdquo;) between you and Hoocay Payments governing the Payment Services (defined below) conducted through or in connection with the Hoocay Platform.<br><br>When these Payments Terms mention &ldquo;Hoocay Payments,&rdquo; &ldquo;we,&rdquo; &ldquo;us,&rdquo; or &ldquo;our,&rdquo; it refers to the Appscraft Sdn Bhd company you are contracting with for Payment Services. <br><br><br>Table of Contents<br><br>1&nbsp;&nbsp; &nbsp;Scope and Use of the Payment Services<br>2&nbsp;&nbsp; &nbsp;Key Definitions<br>3&nbsp;&nbsp; &nbsp;Modification of these Payments Terms<br>4&nbsp;&nbsp; &nbsp;Eligibility, Member Verification<br>5&nbsp;&nbsp; &nbsp;Account Registration<br>6&nbsp;&nbsp; &nbsp;Payment Methods and Payout Methods<br>7&nbsp;&nbsp; &nbsp;Financial Terms for Hosts<br>8&nbsp;&nbsp; &nbsp;Financial Terms for Guests<br>9&nbsp;&nbsp; &nbsp;Appointment of Hoocay Payments as Limited Payment Collection Agent<br>10&nbsp;&nbsp; &nbsp;General Financial Terms<br>11&nbsp;&nbsp; &nbsp;Security Deposits<br>12&nbsp;&nbsp; &nbsp;Currency Conversion<br>13&nbsp;&nbsp; &nbsp;Abandoned Property<br>14&nbsp;&nbsp; &nbsp;Prohibited Activities<br>15&nbsp;&nbsp; &nbsp;Intellectual Property Ownership, Rights Notices<br>16&nbsp;&nbsp; &nbsp;Feedback<br>17&nbsp;&nbsp; &nbsp;Disclaimers<br>18&nbsp;&nbsp; &nbsp;Liability<br>19&nbsp;&nbsp; &nbsp;Indemnification<br>20&nbsp;&nbsp; &nbsp;Termination, Suspension, and other Measures<br>21&nbsp;&nbsp; &nbsp;Applicable Law and Jurisdiction<br>22&nbsp;&nbsp; &nbsp;Dispute Resolution and Arbitration Agreement<br>23&nbsp;&nbsp; &nbsp;General Provisions<br>24&nbsp;&nbsp; &nbsp;Additional Clauses for Users Contracting with Hoocay Payments (Malaysia)<br>25&nbsp;&nbsp; &nbsp;Contacting Hoocay Payments<br><br>1.&nbsp;&nbsp; &nbsp;Scope and Use of the Payment Services<br><br>1.1&nbsp;&nbsp; &nbsp;Hoocay Payments provides payments services to Members, including payment collection services, payments and payouts, in connection with and through the Hoocay Platform (&ldquo;Payment Services&rdquo;).<br><br>1.2&nbsp;&nbsp; &nbsp;Hoocay Payments may restrict the availability of the Payment Services, or certain services or features thereof, to carry out maintenance measures that ensure the proper or improved functioning of the Payment Services. Hoocay Payments may improve, enhance and modify the Payment Services and introduce new Payment Services from time to time.<br><br><br>1.3&nbsp;&nbsp; &nbsp;The Payment Services may contain links to third-party websites or resources (&ldquo;Third-Party Services&rdquo;). Such Third-Party Services are subject to different terms and conditions and privacy practices and Members should review them independently. Hoocay Payments is not responsible or liable for the availability or accuracy of such Third-Party Services, or the content, products, or services available from such Third-Party Services. Links to such Third-Party Services are not an endorsement by Hoocay Payments of such Third-Party Services.<br><br>1.4&nbsp;&nbsp; &nbsp;Your access to or use of certain Payment Services may be subject to, or require you to accept, additional terms and conditions. If there is a conflict between these Payments Terms and terms and conditions applicable for a specific Payment Service, the latter terms and conditions will take precedence with respect to your use of or access to that Payment Service, unless specified otherwise.<br><br><br>2.&nbsp;&nbsp; &nbsp;Key Definitions<br><br>&nbsp;&ldquo;Payment Method&rdquo; means a financial instrument that you have added to your Hoocay Account, such as a credit card, debit card, or PayPal account.<br>&ldquo;Payout Method&rdquo; means a financial instrument that you have added to your Hoocay Account, such as a PayPal account, direct deposit, a prepaid card, or a debit card (where available).<br><br>3.&nbsp;&nbsp; &nbsp;Modification of these Payments Terms<br><br>Hoocay Payments reserves the right to modify these Payments Terms at any time in accordance with this provision. If we make changes to these Payments Terms, we will post the revised Payments Terms on the Hoocay Platform and update the &ldquo;Last Updated&rdquo; date at the top of these Payments Terms. We will also provide you with notice by email of the modification at least thirty (30) days before the date they become effective. We will inform you about your right of refusal and your right to terminate this Agreement in the notification email. If you do not terminate your Agreement before the date the revised Terms become effective, your continued use of the Payment Services will constitute acceptance of the revised Payments Terms.<br><br>4.&nbsp;&nbsp; &nbsp;Eligibility, Member Verification<br><br>4.1&nbsp;&nbsp; &nbsp;You must be at least 18 years old and able to enter into legally binding contracts to use the Payment Services. By using the Payment Services you represent and warrant that you are 18 or older.<br><br>4.2&nbsp;&nbsp; &nbsp;If you are agreeing to these Payments Terms on behalf of a company or other legal entity, you represent and warrant that you have the authority to bind that company or other legal entity to these Payments Terms and, in such event, &ldquo;you&rdquo; and &ldquo;your&rdquo; will refer and apply to that company or other legal entity.<br><br>4.3&nbsp;&nbsp; &nbsp;Hoocay Payments may make access to and use of certain areas or features of the Payment Services subject to certain conditions or requirements, such as completing a verification process or meeting specific eligibility criteria.<br><br>4.4&nbsp;&nbsp; &nbsp;We may make inquiries we consider necessary to help verify or check your identity or prevent fraud. Towards this end, you authorize Hoocay Payments to screen you against third party databases or other sources and request reports from service providers. In some jurisdictions, we have a legal obligation to collect identity information to comply with anti-money laundering regulations. This may include (i) asking you to provide a form of government identification (e.g., driver&rsquo;s license or passport), your date of birth, your address, and other information; (ii) requiring you to take steps to confirm ownership of your email address, Payment Methods or Payout Methods; or (iii) attempting to screen your information against third-party databases. Hoocay Payments reserves the right to close, suspend, or limit access to the Payment Services in the event we are unable to obtain or verify any of this information.<br><br><br>5.&nbsp;&nbsp; &nbsp;Account Registration<br><br>5.1&nbsp;&nbsp; &nbsp;In order to use the Payment Services, you must have an Hoocay Account in good standing. If you or Hoocay closes your Hoocay Account for any reason, you will no longer be able to use the Payment Services.<br><br>5.2 You may authorize a third party to use your Hoocay Account in accordance with the Hoocay Terms. You acknowledge and agree that anyone you authorize to use your Hoocay Account may use the Payment Services on your behalf and that you will be responsible for any payments made by such person.<br>6. Payment Methods and Payout Methods<br><br>6.1 When you add a Payment Method or Payout Method to your Hoocay Account, you will be asked to provide customary billing information such as name, billing address, and financial instrument information either to Hoocay Payments or its third-party payment processor(s). You must provide accurate, current, and complete information when adding a Payment Method or Payout Method, and it is your obligation to keep your Payment Method and Payout Method up-to-date at all times. The information required for Payout Methods will depend on the particular Payout Method and may include:<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your residential address, name on the account, account type, routing number, account number,email address, payout currency, and account information associated with a particular payment processor.<br><br>6.2 When you add or use a new Payment Method, Hoocay Payments may verify the Payment Method by authorizing a nominal amount or by authenticating your account via a third-party payment service provider. For further verification, we may also (i) authorize your Payment Method for one or two additional nominal amounts,and ask you to confirm these amounts, or (ii) require you to upload a billing statement. We may, and retain the right to, initiate refunds of these amounts from your Payout Method. When you add a Payment Method during checkout, we will automatically save that Payment Method to your Hoocay Account so it can be used for a future transaction.<br><br>6.3 Please note that Payment Methods and Payout Methods may involve the use of third-party payment service providers. These service providers may charge you additional fees when processing payments and Payouts in connection with the Payment Services (including deducting charges from the Payout amount), and Hoocay Payments is not responsible for any such fees and disclaims all liability in this regard. Your Payment Method or Payout Method may also be subject to additional terms and conditions imposed by the applicable third-party payment service provider; please review these terms and conditions before using your Payment Method or Payout Method.<br><br>6.4 You authorize Hoocay Payments to store your Payment Method information and charge your Payment Method as outlined in these Payments Terms. If your Payment Method&rsquo;s account information changes (e.g., account number, routing number, expiration date) as a result of re-issuance or otherwise, we may acquire that information from our financial services partner or your bank and update your Payment Method on file in your Hoocay Account.<br><br>6.5 You are solely responsible for the accuracy and completeness of your Payment Method and Payout Method information. Hoocay Payments is not responsible for any loss suffered by you as a result of incorrect Payment Method or Payout Method information provided by you.<br><br><br>7. Financial Terms for Hosts<br><br>7.1 Generally<br><br>Generally speaking, Hoocay Payments will collect the Total Fees from a Guest at the time the Guest&rsquo;s booking request is accepted by the host, or at any other time mutually agreed between the Guest and Hoocay Payments.<br><br>7.2. Payouts<br><br>7.2.1 The time it takes to receive Payouts once released by Hoocay Payments may depend upon the claim you request on host account and it will take about three (3) working days to credit in host account. Hoocay Payments may delay or cancel any Payout for purposes of preventing unlawful activity or fraud, risk assessment, security, or investigation.<br><br>7.2.2 In the event of a Guest&rsquo;s cancellation of a confirmed booking, Hoocay Payments will remit a Payout of any portion of the Total Fees due to you under the applicable cancellation policy.<br><br>7.2.3 For compliance or operational reasons, Hoocay Payments may limit the value of each individual Payout. If you are due an amount above that limit, Hoocay Payments may initiate a series of Payouts (potentially over multiple days) in order to provide your full payout amount.<br><br><br>8. Financial Terms for Guests<br><br>8.1 You authorize Hoocay Payments to charge your Payment Method the Total Fees for any booking requested in connection with your Hoocay Account.&nbsp; Hoocay Payments will collect the Total Fees in the manner agreed between you and Hoocay Payments via the Hoocay Platform. Hoocay Payments will generally collect the Total Fees after the Host accepts your booking request. Hoocay Payments may offer alternative options for the timing and manner of payment. For example, in some cases, Guests may be required to pay or have the option to pay for Host Services in multiple installments. Once the payment transaction for your requested booking is successfully completed, you will receive a confirmation email.<br><br>8.2 When you request to book a Listing, Hoocay Payments may also (i) obtain a pre-authorization via your Payment Method for the Total Fees,(ii) charge or authorize your Payment Method a nominal amount, to verify your Payment Method, or (iii) authenticate your account via a third-party payment service provider to verify your Payment Method.<br><br>8.3 If a requested booking is cancelled either because it is not accepted by the Host or you cancel the booking request before it is accepted by the Host, any amounts collected by Hoocay Payments will be refunded to you(excluding service fees), and any pre-authorization of your Payment Method will be released (if applicable). The timing to receive the refund or for the pre-authorization to be released will vary based on the Payment Method and any applicable payment system (e.g., Visa, MasterCard, etc.) rules.<br><br>8.4 You authorize Hoocay Payments to perform the Payment Method verifications described in Sections 6 and 8, and to charge your Payment Method for any bookings made in connection with your Hoocay Account. You hereby authorize Hoocay Payments to collect any amounts due,by charging the Payment Method provided at checkout, either directly by Hoocay Payments or indirectly, via a third-party online payment processor, and/or by one or more of the payment methods available on the Hoocay Platform.<br><br>9. Appointment of Hoocay Payments as Limited Payment Collection Agent<br><br>9.1 Each Member collecting payment for services provided via the Hoocay Platform (such as Host Services,Co-Host Services, or certain transactions facilitated through the Resolution Center) (&ldquo;Providing Member&rdquo;) hereby appoints Hoocay Payments as the Providing Member&rsquo;s payment collection agent solely for the limited purpose of accepting funds from Members purchasing such services (&ldquo;Purchasing Members&rdquo;).<br><br>9.2 Each Providing Member agrees that payment made by a Purchasing Member through Hoocay Payments, shall be considered the same as a payment made directly to the Providing Member, and the Providing Member will provide the purchased services to the Purchasing Member in the agreed-upon manner as if the Providing Member has received the payment directly from the Purchasing Member. Each Providing Member agrees that Hoocay Payments may refund the Purchasing Member in accordance with the Hoocay Terms. Each Providing Member understands that Hoocay Payments&rsquo; obligation to pay the Providing Member is subject to and conditional upon successful receipt of the associated payments from Purchasing Members. Hoocay Payments guarantees payments to Providing Members only for such amounts that have been successfully received by Hoocay Payments from Purchasing Members in accordance with these Payments Terms. In accepting appointment as the limited payment collection agent of the Providing Member, Hoocay Payments assumes no liability for any acts or omissions of the Providing Member.<br><br>9.3 Each Purchasing Member acknowledges and agrees that, notwithstanding the fact that Hoocay Payments is not a party to the agreement between you and the Providing Member, Hoocay Payments acts as the Providing Member&rsquo;s payment collection agent for the limited purpose of accepting payments from you on behalf of the Providing Member. Upon your payment of the funds to Hoocay Payments, your payment obligation to the Providing Member for the agreed upon amount is extinguished, and Hoocay Payments is responsible for remitting the funds to the Providing Member in the manner described in these Payments Terms, which constitute Hoocay Payments&rsquo; agreement with the Purchasing Member. In the event that Hoocay Payments does not remit any such amounts, the Providing Member will have recourse only against Hoocay Payments and not the Purchasing Member directly.<br><br>10. General Financial Terms<br><br>10.1 Fees<br><br>Hoocay Payments may charge fees for use of certain Payment Services and any applicable fees will be disclosed to Members via the Hoocay Platform.<br><br>10.2 Payment Authorizations<br><br>You authorize Hoocay Payments to collect from you amounts due pursuant to these Payment Terms or the Hoocay Terms. <br><br>Specifically, you authorize Hoocay Payments to collect from you:<br>&nbsp;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Any amount due to Hoocay (e.g., as a result of your bookings, Booking Modifications, cancellations, or other actions as a Guest, Co-Payer, Host or Co-Host or user of the Hoocay Platform), including reimbursement for costs prepaid by Hoocay on your behalf, by charging any Payment Method on file in your Hoocay Account (unless you have previously removed the authorization to charge such Payment Method(s)) or by withholding such amounts from your future Payouts. Any funds collected by Hoocay Payments will set off the amount owed by you to Hoocay and extinguish your obligation to Hoocay.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Any amount due to a Providing Member from a Purchasing Member which Hoocay collects as the Providing Member&rsquo;s payment collection agent as further set out in Section 9 above.<br><br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Any amount paid through the Resolution Center in connection with your Hoocay Account. Hoocay Payments may do so by charging the Payment Method associated with the relevant booking, or any other Payment Method on file in your Hoocay Account (unless you have previously removed the authorization to charge such Payment Method(s)), or by withholding the amount from your future Payouts.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Any Service Fees or cancellation fees imposed pursuant to the Hoocay Term (e.g., if, as a Host, you cancel a confirmed booking). Hoocay Payments will be entitled to recover the amount of any such fees from you, including by subtracting such refund amount out from any future Payouts due to you.<br><br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fees improperly paid to you as a Host or Co-Host. If, as a Host or Co-Host, your Guest cancels a confirmed booking or Hoocay decides that it is necessary to cancel a confirmed booking, and Hoocay issues a refund to the Guest or other applicable cancellation policy, you agree that in the event you have already been paid, Hoocay Payments will be entitled to recover the amount of any such refund from you, including by subtracting such refund amount out from any future Payouts due to you.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fees, costs and/or expenses associated with a Damage Claim, including any Security Deposit. If Hoocay Payments is unable to collect from your Payment Method used to make the booking, you agree that Hoocay Payments may charge any other Payment Method on file in your Hoocay Account at the time of the Damage Claim (unless you have previously removed the authorization to charge such Payment Method(s)). Hoocay Payments also reserves the right to otherwise collect payment from you and pursue any remedies available to Hoocay Payments in this regard in situations in which you are responsible for a Damage Claim, including, but not limited to, in relation to any payment requests made by Hosts.<br><br>In addition to any amount due as outlined above, if there are delinquent amounts or charge backs associated with your Payment Method, you may be charged fees that are incidental to our collection of these delinquent amounts and charge backs. Such fees or charges may include collection fees, convenience fees or other third-party charges.<br><br>11.&nbsp; Refunds<br><br>11.1 Any refunds or credits due to a Member pursuant to the Hoocay Terms will be initiated and remitted by Hoocay Payments.<br><br>11.2 All refunds may be subject to the Hoocay Terms, and Guest Refund Policy. If a Guest or Hoocay decides for any reason to cancel a confirmed booking pursuant to the Hoocay Terms, Guest Refund Policy, you agree that Hoocay Payments will not have any liability for such cancellations or refunds aside from its obligations to remit refunds or Payouts pursuant to these Payments Terms.<br><br>12. Prohibited Activities<br><br>You are solely responsible for compliance with any and all laws, rules, regulations, and Tax obligations that may apply to your use of the Payment Services. In connection with your use of the Payment Services, you may not and you agree that you will not and will not assist or enable others to:<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; breach or circumvent any applicable laws or regulations, agreements with third parties, third-party rights, or the Hoocay Terms, Policies.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; use the Payment Services for any commercial or other purposes that are not expressly permitted by these Payments Terms;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; register or use any Payment Method or Payout Method with your Hoocay Account that is not yours or you do not have authorization to use;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; avoid, bypass, remove, deactivate, impair, descramble, or otherwise circumvent any technological measure implemented by Hoocay Payments or any of Hoocay Payments&rsquo; providers or any other third party to protect the Payment Services;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; take any action that damages or adversely affects, or could damage or adversely affect, the performance or proper functioning of the Payment Services;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; attempt to decipher, decompile, disassemble, or reverse engineer any of the software used to provide the Payment Services; or<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; violate or infringe anyone else&rsquo;s rights or otherwise cause harm to anyone.<br><br>13. Intellectual Property Ownership, Rights Notices<br><br>13.1 The Payment Services are protected by copyright, trademark, and other laws of Malaysia. You acknowledge and agree that the Payment Services, including all associated intellectual property rights, are the exclusive property of Hoocay, Hoocay Payments and its licensors. You will not remove, alter or obscure any copyright, trademark, service mark or other proprietary rights notices incorporated in or accompanying the Payment Services. All trademarks, service marks, logos, trade names, and any other proprietary designations of Hoocay or Hoocay Payments used on or in connection with the Payment Services are trademarks or registered trademarks of Hoocay or Hoocay Payments in Malaysia. Trademarks, service marks, logos, trade names, and any other proprietary designations of third parties used on or in connection with Payment Services are used for identification purposes only and may be the property of their respective owners.<br><br>13.2 You will not use, copy, adapt, modify, prepare derivative works based upon, distribute, license, sell, transfer, publicly display, publicly perform, transmit, broadcast, or otherwise exploit the Payment Services, except as expressly permitted in these Payments Terms. No licenses or rights are granted to you by implication or otherwise under any intellectual property rights owned or controlled by Hoocay, Hoocay Payments, or its licensors, except for the licenses and rights expressly granted in these Payments Terms.<br><br>14. Feedback<br><br>We welcome and encourage you to provide feedback, comments, and suggestions for improvements to the Payment Services (&ldquo;Feedback&rdquo;). You may submit Feedback by emailing us, through the &ldquo;Contact&rdquo; section of the Hoocay Platform, or pursuant to Section 25 (&ldquo;Contacting Hoocay Payments&rdquo;). Any Feedback you submit to us will be considered non-confidential and non-proprietary to you. By submitting Feedback to us, you grant us a non-exclusive, worldwide, royalty-free, irrevocable, sub-licensable, perpetual license to use and publish those ideas and materials for any purpose, without compensation to you.<br><br>15. Disclaimers<br><br>15.1 If you choose to use the Payment Services, you do so voluntarily and at your sole risk. To the maximum extent permitted by law, the Payment Services are provided &ldquo;as is&rdquo;, without warranty of any kind, either express or implied.<br>15.2 Notwithstanding Hoocay Payments&rsquo; appointment as the limited payment collection agent of Providing Members for the purposes of accepting payments from Purchasing Members through the Hoocay Platform, Hoocay Payments explicitly disclaims all liability for any act or omission of any Member or other third party. Hoocay Payments does not have any duties or obligations as agent for each Providing Member except to the extent expressly set forth in these Payments Terms, and any additional duties or obligations as may be implied by law are, to the maximum extent permitted by applicable law, expressly excluded.<br>15.3 If we choose to conduct identity verification on any Member, to the extent permitted by applicable law, we disclaim warranties of any kind, either express or implied, that such checks will identify prior misconduct by a Member or guarantee that a Member will not engage in misconduct in the future.<br>15.4 The foregoing disclaimers apply to the maximum extent permitted by law. You may have other statutory rights or warranties which cannot lawfully be excluded. However, the duration of any statutorily required warranties shall be limited to the maximum extent (if any) permitted by law.<br><br>16. Indemnification<br><br>You agree to release, defend (at Hoocay Payments&rsquo; option), indemnify, and hold Hoocay Payments and its affiliates and subsidiaries, and their officers, directors, employees, and agents, harmless from and against any claims, liabilities, damages, losses, and expenses, including, without limitation, reasonable legal and accounting fees, arising out of or in any way connected with (i) your breach of these Payments Terms; (ii) your improper use of the Payment Services; (iii) Hoocay Payments&rsquo; Collection and Remittance of Occupancy Taxes; or (iv) your breach of any laws, regulations, or third-party rights.<br><br>17. Termination, Suspension, and other Measures<br><br>17.1 You may terminate this Agreement at any time by sending us an email, or by following the termination procedures specified in the Hoocay Terms. Terminating this Agreement will also serve as notice to cancel your Hoocay Account pursuant to the Hoocay Terms. If you cancel your Hoocay Account as a Host, Hoocay Payments will provide a full refund to any Guests with confirmed booking(s). If you cancel your Hoocay Account as a Guest, Hoocay Payments will initiate a refund for any confirmed booking(s) based on the Listing&rsquo;s cancellation policy.<br>17.2 Without limiting our rights specified below, Hoocay Payments may terminate this Agreement for convenience at any time by giving you thirty (30) days\' notice via email to your registered email address <br>17.3 Hoocay Payments may immediately, without notice terminate this Agreement if (i) you have materially breached your obligations under this Agreement; (ii) you have provided inaccurate, fraudulent, outdated, or incomplete information; (iii) you have violated applicable laws, regulations, or third-party rights; or (iv) Hoocay Payments believes in good faith that such action is reasonably necessary to protect other Members, Hoocay, Hoocay Payments, or third parties (for example in the case of fraudulent behavior of a Member).<br>17.4 In addition, Hoocay Payments may limit or temporarily or permanently suspend your use of or access to the Payment Services (i) to comply with applicable law, or the order or request of a court, law enforcement, or other administrative agency or governmental body, or if (ii) you have breached these Payments Terms, the Hoocay Terms, applicable laws, regulations or third-party rights, (iii) you have provided inaccurate, fraudulent, outdated, or incomplete information regarding a Payment Method or Payout Method, or (iv) Hoocay Payments believes in good faith that such action is reasonably necessary to protect the personal safety or property of Hoocay, its Members, Hoocay Payments, or third parties, or to prevent fraud or other illegal activity.<br>17.5 In case of non-material breaches and where appropriate, you will be given notice of any measure by Hoocay Payments and an opportunity to resolve the issue to Hoocay Payments\' reasonable satisfaction.<br>17.6 If you are a Host and we take any of the measures described in this Section we may refund your Guests in full for any and all confirmed bookings, irrespective of preexisting cancellation policies, and you will not be entitled to any compensation for pending or confirmed bookings that were cancelled.<br>17.7 If your access to or use of the Payment Services has been limited or this Agreement has been terminated by us, you may not register a new Hoocay Account or attempt to access and use the Payment Services through other an Hoocay Account of another Member.<br><br><br><br><br><br>18. Contacting Hoocay Payments<br><br>You may contact Hoocay Payments regarding the Payment Services using the information below:<br>Entity&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;Contact Information&nbsp;&nbsp; &nbsp;<br>Hoocay Payments, <br>Appscraft Sdn Bhd&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;No 8 USJ 11/3 J UEP<br>Subang Jaya<br>Selangor,<br>Malaysia<br>Payment@Hoocay<br>&nbsp;&nbsp; &nbsp;<br>These Payments Terms are available at www.Hoocay/terms/payments_terms. Hoocay Payments will provide a copy of these Payments Terms on your request. If you have any questions about these Payments Terms, please email us.<br><br><br><br><br><br><br></p>\n');
INSERT INTO `page_contents` (`id`, `page_id`, `language_id`, `title`, `content`) VALUES
(7, 3, 1, 'Privacy Policy', '\n<p>PRIVACY<br><br>Last Updated: August 7, 2018<br><br>Thank you for using Hoocay!<br><br>This Privacy Policy describes how we collect, use, process, and disclose your information, including personal information, in conjunction with your access to and use of the Hoocay Platform and the Payment Services.<br>If you see an undefined term in this Privacy Policy (such as &ldquo;Listing&rdquo; or &ldquo;Hoocay Platform&rdquo;), it has the same definition as in our Terms of Service.<br><br>When this policy mentions &ldquo;Hoocay,&rdquo; &ldquo;we,&rdquo; &ldquo;us,&rdquo; or &ldquo;our,&rdquo; it refers to the Hoocay company&nbsp; (Appscraft Sdn Bhd) (1278150M) that is responsible for your information under this Privacy Policy (the &ldquo;Data Controller&rdquo;).<br><br>This Privacy Policy also applies to the Payment Services provided to you by Hoocay Payments pursuant to the Payments Terms of Service (&ldquo;Payments Terms&rdquo;). When using the Payment Services, you will be also providing your information, including personal information, to one or more Hoocay Payments entities, which will also be the Data Controller (the \"Payments Data Controller\") of your information related to the Payment Services.<br><br>1. INFORMATION WE COLLECT<br><br>There are three general categories of information we collect.<br><br>1.1&nbsp;&nbsp; &nbsp;Information You Give to Us.<br><br>1.1.1 Information that is necessary for the use of the Hoocay Platform.<br>We ask for and collect the following personal information about you when you use the Hoocay Platform. This information is necessary for the adequate performance of the contract between you and us and to allow us to comply with our legal obligations. Without it, we may not be able to provide you with all the requested services.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; Account Information. When you sign up for an Hoocay Account, we require certain information such as your first name, last name, email address, and date of birth.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; Profile and Listing Information. To use certain features of the Hoocay Platform (such as booking or creating a Listing), we may ask you to provide additional information, which may include your address, phone number, and a profile picture.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; Identity Verification Information. To help create and maintain a trusted environment, we may collect identity verification information (such as images of your government issued ID, passport, national ID card, or driving license, as permitted by applicable laws) or other authentication information. To learn more, see our Help Center article about providing identification on Hoocay.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; Payment Information. To use certain features of the Hoocay Platform (such as booking or creating a Listing), we may require you to provide certain financial information (like your bank account or credit card information) in order to facilitate the processing of payments (via Hoocay Payments).<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; Communications with Hoocay and other Members. When you communicate with Hoocay or use the Hoocay Platform to communicate with other Members, we collect information about your communication and any information you choose to provide.<br><br>1.1.2 Information you choose to give us.<br>You may choose to provide us with additional personal information in order to obtain a better user experience when using Hoocay Platform. This additional information will be processed based on your consent.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Additional Profile Information. You may choose to provide additional information as part of your Hoocay profile (such as gender, preferred language(s), city, and a personal description). Some of this information as indicated in your Account settings is part of your public profile page, and will be publicly visible to others.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Address Book Contact Information. You may choose to import your address book contacts or enter your contacts&rsquo; information manually to access certain features of the Hoocay Platform, like inviting them to use Hoocay.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Other Information. You may otherwise choose to provide us information when you fill in a form, conduct a search, update or add information to your Hoocay Account, respond to surveys, post to community forums, participate in promotions, or use other features of the Hoocay Platform.<br><br>1.1.3 Information that is necessary for the use of the Payment Services.<br>The Payments Data Controller needs to collect the following information, as it is necessary for the adequate performance of the contract with you and to comply with applicable law (such as anti-money laundering regulations). Without it, you will not be able to use Payment Services:<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Payment Information. When you use the Payment Services, the Payments Data Controller requires certain financial information (like your bank account or credit card information) in order to process payments and comply with applicable law.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Identity Verification and Other Information. If you are a Host, the Payments Data Controller may require identity verification information (such as images of your government issued ID, passport, national ID card, or driving license) or other authentication information, your date of birth, your address, email address, phone number and other information in order to verify your identity, provide the Payment Services to you, and to comply with applicable law.<br><br><br>1.2&nbsp;&nbsp; &nbsp;Information We Automatically Collect from Your Use of the Hoocay Platform and Payment Services.<br><br>When you use the Hoocay Platform and the Payment Services, we automatically collect information, including personal information, about the services you use and how you use them. This information is necessary for the adequate performance of the contract between you and us, to enable us to comply with legal obligations and given our legitimate interest in being able to provide and improve the functionalities of the Hoocay Platform and Payment Services.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Geo-location Information. When you use certain features of the Hoocay Platform, we may collect information about your precise or approximate location as determined through data such as your IP address or mobile device&rsquo;s GPS to offer you an improved user experience. Most mobile devices allow you to control or disable the use of location services for applications in the device&rsquo;s settings menu. Hoocay may also collect this information even when you are not using the app if this connection is enabled through your settings or device permissions.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Usage Information. We collect information about your interactions with the Hoocay Platform such as the pages or content you view, your searches for Listings, bookings you have made, and other actions on the Hoocay Platform.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Log Data and Device Information. We automatically collect log data and device information when you access and use the Hoocay Platform, even if you have not created an Hoocay Account or logged in. That information includes, among other things: details about how you&rsquo;ve used the Hoocay Platform (including if you clicked on links to third party applications), IP address, access dates and times, hardware and software information, device information, device event information, unique identifiers, crash data, cookie data, and the pages you&rsquo;ve viewed or engaged with before or after using the Hoocay Platform.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cookies and Similar Technologies. We use cookies and other similar technologies, such as web beacons, pixels, and mobile identifiers. We may also allow our business partners to use these tracking technologies on the Hoocay Platform, or engage others to track your behavior on our behalf. While you may disable the usage of cookies through your browser settings, the Hoocay Platform currently does not respond to a &ldquo;Do Not Track&rdquo; signal in the HTTP header from your browser or mobile application due to lack of standardization regarding how that signal should be interpreted. For more information on our use of these technologies, see our Cookie Policy. &nbsp;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Payment Transaction Information. Hoocay Payments collects information related to your payment transactions through the Hoocay Platform, including the payment instrument used, date and time, payment amount, payment instrument expiration date and billing postcode, PayPal email address, IBAN information, your address and other related transaction details. This information is necessary for the adequate performance of the contract between you and Hoocay Payments and to allow the provision of the Payment Services.<br>1.3&nbsp;&nbsp; &nbsp;Information We Collect from Third Parties.<br><br>Hoocay and Hoocay Payments may collect information, including personal information, that others provide about you when they use the Hoocay Platform and the Payment Services, or obtain information from other sources and combine that with information we collect through the Hoocay Platform and the Payment Services. We do not control, supervise or respond for how the third parties providing your information process your personal data, and any information request regarding the disclosure of your personal information to us should be directed to such third parties.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Third Party Services. If you link, connect, or login to your Hoocay Account with a third party service (e.g. Google, Facebook), the third party service may send us information such as your registration and profile information from that service. This information varies and is controlled by that service or as authorized by you via your privacy settings at that service.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Your References. If someone has written a reference for you, it will be published on your Hoocay public profile page with your consent. To learn more, see our Help Center article about References.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Background Information. For Members permitted by applicable laws and with your consent where required, Hoocay and Hoocay Payments may obtain the local version of police, background or registered sex offender checks. We may use your information, including your full name and date of birth, to obtain such reports.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Other Sources. To the extent permitted by applicable law, we may receive additional information about you, such as demographic data or fraud detection information, from third party service providers and/or partners, and combine it with information we have about you. For example, we may receive background check results (with your consent where required) or fraud warnings from service providers like identity verification services for our fraud prevention and risk assessment efforts. We may receive information about you and your activities on and off the Hoocay Platform through partnerships, or about your experiences and interactions from our partner ad networks.<br><br>2. HOW WE USE INFORMATION WE COLLECT<br><br>We use, store, and process information, including personal information, about you to provide, understand, improve, and develop the Hoocay Platform, create and maintain a trusted and safer environment and comply with our legal obligations.<br><br>2.1 Provide, Improve, and Develop the Hoocay Platform.<br>&nbsp; <br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Enable you to access and use the Hoocay Platform.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Enable you to communicate with other Members.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Operate, protect, improve, and optimize the Hoocay Platform and experience, such as by performing analytics and conducting research.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Provide customer service.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Send you service or support messages, updates, security alerts, and account notifications.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you provide us with your contacts&rsquo; information, we may process this information: (i) to facilitate your referral invitations, (ii) send your requests for references, (iii) for fraud detection and prevention, and (iv) for any purpose you authorize at the time of collection.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To operate, protect, improve, and optimize the Hoocay Platform and experience, and personalize and customize your experience (such as making Listing suggestions or ranking search results), we conduct profiling based on your interactions with the Hoocay Platform, your search and booking history, your profile information and preferences, and other content you submit to the Hoocay Platform.<br><br>We process this information given our legitimate interest in improving the Hoocay Platform and our Members&rsquo; experience with it, and where it is necessary for the adequate performance of the contract with you.<br><br>2.2 Create and Maintain a Trusted and Safer Environment.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Detect and prevent fraud, spam, abuse, security incidents, and other harmful activity.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Conduct security investigations and risk assessments.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Verify or authenticate information or identifications provided by you (such as to verify your Accommodation address or compare your identification photo to another photo you provide).<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Conduct checks against databases and other information sources, including background or police checks, to the extent permitted by applicable laws and with your consent where required.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Comply with our legal obligations.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resolve any disputes with any of our Members and enforce our agreements with third parties.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Enforce our Terms of Service and other policies.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In connection with the activities above, we may conduct profiling based on your interactions with the Hoocay Platform, your profile information and other content you submit to the Hoocay Platform, and information obtained from third parties. In limited cases, automated processes may restrict or suspend access to the Hoocay Platform if such processes detect a Member or activity that we think poses a safety or other risk to the Hoocay Platform, other Members, or third parties.<br><br>We process this information given our legitimate interest in protecting the Hoocay Platform, to measure the adequate performance of our contract with you, and to comply with applicable laws.<br><br>2.3 Provide, Personalize, Measure, and Improve our Advertising and Marketing.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Send you promotional messages, marketing, advertising, and other information that may be of interest to you based on your preferences (including information about Hoocay or partner campaigns and services) and social media advertising through social media platforms such as Facebook or Google).<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Personalize, measure, and improve our advertising.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Administer referral programs, rewards, surveys, sweepstakes, contests, or other promotional activities or events sponsored or managed by Hoocay or its third party partners.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Conduct profiling on your characteristics and preferences (based on the information you provide to us, your interactions with the Hoocay Platform, information obtained from third parties, and your search and booking history) to send you promotional messages, marketing, advertising and other information that we think may be of interest to you.<br><br>We will process your personal information for the purposes listed in this section given our legitimate interest in undertaking marketing activities to offer you products or services that may be of your interest. You can opt-out of receiving marketing communications from us by following the unsubscribe instructions included in our marketing communications or changing your notification settings within your Hoocay Account.<br><br>2.4 How the Payments Data Controller uses the Information Collected.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Enable you to access and use the Payment Services.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Detect and prevent fraud, abuse, security incidents, and other harmful activity.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Conduct security investigations and risk assessments.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Conduct checks against databases and other information sources.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Comply with legal obligations (such as anti-money laundering regulations).<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Enforce the Payment Terms and other payment policies.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; With your consent, send you promotional messages, marketing, advertising, and other information that may be of interest to you based on your preferences.<br><br>The Payments Data Controller processes this information given its legitimate interest in improving the Payment Services and its users&rsquo; experience with it, and where it is necessary for the adequate performance of the contract with you and to comply with applicable laws.<br><br>3. SHARING &amp; DISCLOSURE<br><br>3.1 With Your Consent.<br><br>Where you have provided consent, we share your information, including personal information, as described at the time of consent, such as when you authorize a third party application or website to access your Hoocay Account or when you participate in promotional activities conducted by Hoocay partners or third parties.<br><br>3.2 Sharing between Members.<br><br>To help facilitate bookings or other interactions between Members, we may need to share certain information, including personal information, with other Members, as it is necessary for the adequate performance of the contract between you and us, as follows:&nbsp; &nbsp;<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When you as a Guest submit a booking request, certain information about you is shared with the Host (and Co-Host, if applicable), including your full name, the full name of any additional Guests, your cancellation history, and other information you agree to share. When your booking is confirmed, we will disclose additional information to assist with coordinating the trip, like your phone number.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When you as a Host (or Co-Host, if applicable) have a confirmed booking, certain information is shared with the Guest to coordinate the booking, such as your full name, phone number, and Accommodation or Experience address. &nbsp;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When you as a Host invite another Member to become a Co-Host, you authorize the Co-Host to access your information and Member Content, including but not limited to certain information like your full name, phone number, Accommodation address, and email address.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When you as a Guest invite additional Guests to a booking, your full name, travel dates, Host name, Listing details, the Accommodation address, and other related information will be shared with each additional Guest.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When you as a Guest initiate a Group Payment Booking Request certain information about each participant such as first name, last initial, profile picture as well as the booking details is shared among all participants of the Group Payment Booking Request.<br><br>We don&rsquo;t share your billing and payout information with other Members. &nbsp;<br><br>3.3 Profiles, Listings, and other Public Information.<br><br>The Hoocay Platform lets you publish information, including personal information, that is visible to the general public. For example:<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Parts of your public profile page, such as your first name, your description, and city, are publicly visible to others.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Listing pages are publicly visible and include information such as the Accommodation or Experience&rsquo;s approximate location (neighbourhood and city) or precise location (where you have provided your consent), Listing description, calendar availability, your public profile photo, aggregated demand information (like page views over a period of time), and any additional information you choose to share.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; After completing a booking, Guests and Hosts may write Reviews and rate each other. Reviews and Ratings are a part of your public profile page and may also be surfaced elsewhere on the Hoocay Platform (such as the Listing page).<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you submit content in a community or discussion forum, blog or social media post, or use a similar feature on the Hoocay Platform, that content is publicly visible. &nbsp;<br><br>Based on our legitimate interest to promote the Hoocay Platform we may display parts of the Hoocay Platform (e.g., your Listing page) on sites operated by Hoocay&rsquo;s business partners, using technologies such as widgets or APIs. If your Listings are displayed on a partner&rsquo;s site, information from your public profile page may also be displayed.<br><br>Information you share publicly on the Hoocay Platform may be indexed through third party search engines. In some cases, you may opt-out of this feature in your Account settings. If you change your settings or your public-facing content, these search engines may not update their databases. We do not control the practices of third party search engines, and they may use caches containing your outdated information.<br><br>3.4 Additional Services by Hosts.<br><br>Hosts may need to use third party services available through the Hoocay Platform to assist with managing their Accommodation or providing additional services requested by you, such as cleaning services or lock providers. Hosts may use features on the Hoocay Platform to share information about the Guest (like check-in and check-out dates, Guest name, Guest phone number) with such third party service providers for the purposes of coordinating the stay, managing the Accommodation, or providing other services.<br><br>3.5 Compliance with Law, Responding to Legal Requests, Preventing Harm and&nbsp;&nbsp; Protection of our Rights.<br><br>Hoocay and Hoocay Payments may disclose your information, including personal information, to courts, law enforcement or governmental authorities, or authorized third parties, if and to the extent we are required or permitted to do so by law or if such disclosure is reasonably necessary: (i) to comply with our legal obligations, (ii) to comply with legal process and to respond to claims asserted against Hoocay, (iii) to respond to verified requests relating to a criminal investigation or alleged or suspected illegal activity or any other activity that may expose us, you, or any other of our users to legal liability, (iv) to enforce and administer our Terms of Service, the Payment Terms or other agreements with Members, or (v) to protect the rights, property or personal safety of Hoocay, its employees, its Members, or members of the public.<br><br><br><br>These disclosures may be necessary to comply with our legal obligations, for the protection of your or another person\'s vital interests or for the purposes of our or a third party&rsquo;s legitimate interest in keeping the Hoocay Platform secure, preventing harm or crime, enforcing or defending legal rights, or preventing damage.<br><br>Where appropriate, we may notify Members about legal requests unless: (i) providing notice is prohibited by the legal process itself, by court order we receive, or by applicable law, or (ii) we believe that providing notice would be futile, ineffective, create a risk of injury or bodily harm to an individual or group, or create or increase a risk of fraud upon Hoocay&rsquo;s property, its Members and the Hoocay Platform. In instances where we comply with legal requests without notice for these reasons, we will attempt to notify that Member about the request after the fact where appropriate and where we determine in good faith that we are no longer prevented from doing so.<br><br>3.6 Corporate Affiliates.<br><br>To enable or support us in providing the Hoocay Platform and the Payment Services, we may share your information, including personal information, within our corporate family of companies (both financial and non-financial entities) that are related by common ownership or control.<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sharing with Appscraft Sdn Bhd. Even if your Country of Residence is not the Malaysia, your information may be shared with Appscraft Sdn Bhd. which provides the technical infrastructure for the&nbsp; Hoocay Platform, product development and maintenance, customer support, trust and safety and other business operation services to other Hoocay entities. The data sharing is necessary for the performance of the contract between you and us and is based on our legitimate interests in providing the Hoocay Platform globally.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sharing with Hoocay Payments. In order to facilitate payments on or through the Hoocay Platform, certain information as described above in Section 1.1.3, may be shared with the relevant Hoocay Payments entity. The data sharing is necessary for the performance of the contract between you and us.<br><br>Additionally, we share your information, including personal information, with our corporate affiliates in order to support and integrate, promote, and to improve the Hoocay Platform and our affiliates&rsquo; services. <br>&nbsp; <br>3.7 Social Media Platforms.<br><br>Where permissible according to applicable law we may use certain limited personal information about you, such as your email address, to hash it and to share it with social media platforms, such as Facebook or Google, to generate leads, drive traffic to our websites or otherwise promote our products and services or the Hoocay Platform. These processing activities are based on our legitimate interest in undertaking marketing activities to offer you products or services that may be if your interest.<br>The social media platforms with which we may share your personal data are not controlled or supervised by Hoocay. Therefore, any questions regarding how your social media platform service provider processes your personal data should be directed to such provider.<br><br>Please note that you may, at any time ask Hoocay to cease processing your data for these direct marketing purposes by sending an e-mail to Admin@Hoocay.<br><br>3.8 Government Registration.<br><br>In jurisdictions where Hoocay facilitates or requires a registration, notification, permit, or license application of a Host with a local governmental authority through the Hoocay Platform in accordance with local law, we may share information of participating Hosts with the relevant authority, both during the application process and, if applicable, periodically thereafter, such as the Host&rsquo;s full name and contact details, Accommodation address, tax identification number, Listing details, and number of nights booked.<br><br>3.9 Business Transfers.<br><br>If Hoocay undertakes or is involved in any merger, acquisition, reorganization, sale of assets, bankruptcy, or insolvency event, then we may sell, transfer or share some or all of our assets, including your information in connection with such transaction or in contemplation of such transaction (e.g., due diligence). In this event, we will notify you before your personal information is transferred and becomes subject to a different privacy policy.<br><br>3.10 Aggregated Data.<br><br>We may also share aggregated information (information about our users that we combine together so that it no longer identifies or references an individual user) and other anonymized information for regulatory compliance, industry and market analysis, demographic profiling, marketing and advertising, and other business purposes.<br><br>4. OTHER IMPORTANT INFORMATION<br><br>4.1 Analyzing your Communications.<br><br>We may review, scan, or analyze your communications on the Hoocay Platform for fraud prevention, risk assessment, regulatory compliance, investigation, product development, research, and customer support purposes. For example, as part of our fraud prevention efforts, we scan and analyze messages to mask contact information and references to other websites. In some cases, we may also scan, review, or analyze messages to debug, improve, and expand product offerings. We use automated methods where reasonably possible. However, occasionally we may need to manually review some communications, such as for fraud investigations and customer support, or to assess and improve the functionality of these automated tools. We will not review, scan, or analyze your communications to send third party marketing messages to you, and we will not sell reviews or analyses of these communications.<br><br>These activities are carried out based on Hoocay\'s legitimate interest in ensuring compliance with applicable laws and our Terms, preventing fraud, promoting safety, and improving and ensuring the adequate performance of our services.<br><br>4.2 Linking Third Party Accounts.<br><br>You may link your Hoocay Account with your account at a third party social networking service. Your contacts on these third party services are referred to as &ldquo;Friends.&rdquo;&nbsp; When you create this link:<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; some of the information you provide to us from the linking of your accounts may be published on your Hoocay Account profile;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your activities on the Hoocay Platform may be displayed to your Friends on the Hoocay Platform and/or that third party site;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a link to your public profile on that third party social networking service may be included in your Hoocay public profile;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; other Hoocay users may be able to see any common Friends that you may have with them, or that you are a Friend of their Friend if applicable;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; other Hoocay users may be able to see any schools, hometowns or other groups you have in common with them as listed on your linked social networking service;<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the information you provide to us from the linking of your accounts may be stored, processed and transmitted for fraud prevention and risk assessment purposes; and<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the publication and display of information that you provide to Hoocay through this linkage is subject to your settings and authorizations on the Hoocay Platform and the third party site.<br><br>We only collect your information from linked third party accounts to the extent necessary to ensure the adequate performance of our contract with you, or to ensure that we comply with applicable laws, or with your consent.<br><br>4.3 Google Maps/Earth.<br><br>Parts of the Hoocay Platform use Google Maps/Earth services, including the Google Maps API(s). Use of Google Maps/Earth is subject to Google Maps/Earth Additional Terms of Use and the Google Privacy Policy.<br><br>5. THIRD PARTY PARTNERS &amp; INTEGRATIONS<br><br>The Hoocay Platform may contain links to third party websites or services, such as third party integrations, co-branded services, or third party-branded services (&ldquo;Third Party Partners&rdquo;). Hoocay doesn&rsquo;t own or control these Third Party Partners and when you interact with them, you may be providing information directly to the Third Party Partner, Hoocay, or both. These Third Party Partners will have their own rules about the collection, use, and disclosure of information. We encourage you to review the privacy policies of the other websites you visit.<br><br>6. YOUR RIGHTS<br><br>You may exercise any of the rights described in this section before your applicable Hoocay Data Controller and Payments Data Controller by sending an email to dpo@Hoocay. Please note that we may ask you to verify your identity before taking further action on your request.<br><br>6.1 Managing Your Information.<br><br>You may access and update some of your information through your Account settings. If you have chosen to connect your Hoocay Account to a third-party application, like Facebook or Google, you can change your settings and remove permission for the app by changing your Account settings. You are responsible for keeping your personal information up-to-date.<br><br>6.2 Rectification of Inaccurate or Incomplete Information.<br><br>You have the right to ask us to correct inaccurate or incomplete personal information concerning you (and which you cannot update yourself within your Hoocay Account.<br><br>6.3 Data Access and Portability.<br><br>In some jurisdictions, applicable law may entitle you to request copies of your personal information held by us. You may also be entitled to request copies of personal information that you have provided to us in a structured, commonly used, and machine-readable format and/or request us to transmit this information to another service provider (where technically feasible).<br><br>6.4 Data Retention and Erasure.<br><br>We generally retain your personal information for as long as is necessary for the performance of the contract between you and us and to comply with our legal obligations. If you no longer want us to use your information to provide the Hoocay Platform to you, you can request that we erase your personal information and close your Hoocay Account. Please note that if you request the erasure of your personal information:<br><br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may retain some of your personal information as necessary for our legitimate business interests, such as fraud detection and prevention and enhancing safety. For example, if we suspend an Hoocay Account for fraud or safety reasons, we may retain certain information from that Hoocay Account to prevent that Member from opening a new Hoocay Account in the future.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may retain and use your personal information to the extent necessary to comply with our legal obligations. For example, Hoocay and Hoocay Payments may keep some of your information for tax, legal reporting and auditing obligations.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Information you have shared with others (e.g., Reviews, forum postings) may continue to be publicly visible on the Hoocay Platform, even after your Hoocay Account is cancelled. However, attribution of such information to you will be removed. Additionally, some copies of your information (e.g., log records) may remain in our database, but are disassociated from personal identifiers.<br>&bull;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Because we maintain the Hoocay Platform to protect from accidental or malicious loss and destruction, residual copies of your personal information may not be removed from our backup systems for a limited period of time.<br><br>6.5 Withdrawing Consent and Restriction of Processing.<br><br>Where you have provided your consent to the processing of your personal information by Hoocay you may withdraw your consent at any time by changing your Account settings or by sending a communication to Hoocay specifying which consent you are withdrawing. Please note that the withdrawal of your consent does not affect the lawfulness of any processing activities based on such consent before its withdrawal. Additionally, in some jurisdictions, applicable law may give you the right to limit the ways in which we use your personal information, in particular where (i) you contest the accuracy of your personal information; (ii) the processing is unlawful and you oppose the erasure of your personal information; (iii) we no longer need your personal information for the purposes of the processing, but you require the information for the establishment, exercise or defence of legal claims; or (iv) you have objected to the processing pursuant to Section 6.6 and pending the verification whether the legitimate grounds of Hoocay override your own.<br><br>6.6 Objection to Processing.<br><br>In some jurisdictions, applicable law may entitle you to require Hoocay and Hoocay Payments not to process your personal information for certain specific purposes (including profiling) where such processing is based on legitimate interest. If you object to such processing Hoocay and/or Hoocay Payments will no longer process your personal information for these purposes unless we can demonstrate compelling legitimate grounds for such processing or such processing is required for the establishment, exercise or defence of legal claims.<br><br>Where your personal information is processed for direct marketing purposes, you may, at any time ask Hoocay to cease processing your data for these direct marketing purposes by sending an e-mail to Admin@Hoocay.<br><br>6.7 Lodging Complaints.<br>You have the right to lodge complaints about the data processing activities carried out by Hoocay and Hoocay Payments before the competent data protection authorities.<br><br>7. SECURITY<br><br>We are continuously implementing and updating administrative, technical, and physical security measures to help protect your information against unauthorized access, loss, destruction, or alteration. Some of the safeguards we use to protect your information are firewalls and data encryption, and information access controls. If you know or have reason to believe that your Hoocay Account credentials have been lost, stolen, misappropriated, or otherwise compromised or in case of any actual or suspected unauthorized use of your Hoocay Account, please contact us following the instructions in the Contact Us section below.<br><br>9. CHANGES TO THIS PRIVACY POLICY<br><br>Hoocay reserves the right to modify this Privacy Policy at any time in accordance with this provision. If we make changes to this Privacy Policy, we will post the revised Privacy Policy on the Hoocay Platform and update the &ldquo;Last Updated&rdquo; date at the top of this Privacy Policy. We will also provide you with notice of the modification by email at least thirty (30) days before the date they become effective. If you disagree with the revised Privacy Policy, you may cancel your Account. If you do not cancel your Account before the date the revised Privacy Policy becomes effective, your continued access to or use of the Hoocay Platform will be subject to the revised Privacy Policy.<br><br>10. CONTACT US<br><br>If you have any questions or complaints about this Privacy Policy or Hoocay&rsquo;s information handling practices, you may email us or contact us at:<br><br><br>Appscraft Sdn Bhd<br>No 8, USJ 11/3 J UEP,<br>Subang Jaya, Selangor<br>Malaysia<br><br></p>\n');
