INSERT INTO `property_contents` (`id`, `property_id`, `language_id`, `name`, `description`, `ref_no`) VALUES
(63, 44, 1, 'JJ\'s Homestay Melaka', '<p>JJ\'s Homestay Melaka is located at Taman Tambi Chik Karim, Batu Berendam Melaka. It is located strategicly in the middle of Melaka. 10min to Melaka Town, 10 min to Ayer Keroh. It is near to Batu Berendam Airport and Melaka sentral where tourist can easily found public transport to go and tour around Melaka</p><p>JJ\'s Homestay is a double storey terrace house with friendly neighbourhood near to Mosque and plenty of restaurant such as Mcdonalds, Pizza Hut, Dominos Pizza , and gas station also available . In our Homestay there are 3 bedrooms. Only the master bedroom is with air conditioner. we have 2 bath rooms. We provide some cook utensils such as spoon, fork , pan and so on . Just like Home .</p>', ''),
(64, 45, 1, 'Sri Kandis CottageStay, Kuching, Sarawak', '<p><b><u>Chalet Cottage stay \"Pondok Tumpang\" / Guest House di Kpg Siol Kandis&nbsp;&nbsp;</u></b><br></p><p>\r\nCottage Stay \"Pondok Tumpang\" kami mempunyai 2 bilik tidur dgn keselesaan untuk 7-8 orang dengan 3 katil double bed &amp; 1 single bed, Chalet/Cottage boleh menempatkan sehingga 10 org(caj extra katil+tilam rm10 1 malam) 2 Bilik tidur berhawa dingin serta bilik air + air panas(water heater), Cottage dengan 1 ruang tamu selesa dengan 1 ruang makan meja 6 orang, dilengkapi kerusi sofa dan TV satelit (Astro). Cottage ini juga mempunyai Dapur dengan kelengkapan dapur sedia ada (peti ais +dapur gas+sinki+mesin basuh pakaian)&nbsp;</p><p>\r\n</p><p>\r\n</p><p>Tel 0128781392 untuk maklumat lebih lanjut mengenai Chalet \"Pondok Tumpang\" dan pakej yang ditawarkan.</p>', ''),
(65, 46, 1, 'CT santai', '<p>Rumah teres dua tingkat yang terletak di Seremban Jaya, Senawang. dekat dengan exit Tol Senawang Plus Highway. Kami mengutamakan kebersihan dan keselesaan tetamu yang menginap disini, penyediaan sarapan dan makanan tengah hari atau makan malam boleh di buat mengikut permintaan. Di Senawang juga terdapat beberapa tempat makan menarik seperti, Nasi Arab Damsyik, Tomyam Seafood dan juga Mee bandung Jawa yang sangat terkenal. terdapat juga access mudah bagi mereka yang ingin ke Seremban, Kuala Pilah atau Kuala Lumpur.</p><p><br></p><p><b>KEMUDAHAN SEKITAR</b></p><p>1. Pasaraya Tesco</p><p>2. Kedai makan popular Doll Tomyam</p><p>3. Surau</p><p>4. Kedai Runcit</p><p>5. Taman Permainan</p><p>6. Parking Kereta</p><p>7. Stesen minyak (shell)</p><p><br></p><p><br></p><p><br></p>', ''),
(66, 47, 1, 'Teratak Sofea', '<p>Homestay unik yang berkonsepkan rumah kayu tradisional tetapi berfasilitikan kemudahan yang serba moden.<br>Dilengkapi dengan 3 unit sistem penghawa dingin (2 bilik 1 ruang tamu)<br>Juga diserikan dengan balkoni yang luas, kemudahan memasak, membasuh, perabot rumah yang lengkap.<br>Paling istimewa kami menyediakan 2 kolam renang yang menarik dan pasti sesuai untuk anda beriadah seisi keluarga.<br>Berhampiran dengan tempat-tempat lain yang menarik di sekitar Telok Panglima Garang, Selangor.</p>', ''),
(67, 48, 1, 'Mawar Putih Homestay', '<p>Sesuai untuk penginapan keluarga besar untuk berkumpul atau sebagai transit bagi percutian dan kenduri khawin sekitar Ipoh.</p><p>Mengambil masa dalam 10 - 15 minit untuk ke :</p><p><br></p><p><b>1.</b> <b>MAPS</b></p><p><b>2. Bulatan Aman Jaya</b></p><p><b>3. Taman Rekreasi Kledang Sayong</b></p><p><b>5. Air Terjun Ulu Chepor.</b></p><p><b><br></b></p><p>Terdapat beberapa empat makan menarik di sekitar, antaranyaMee Rebus Ramlee,D\'Naina Nasi Kandar, KFC, Pizza Hut. dan juga sekitar kawasan Mydin Meru Raya</p><p><br></p><p><br></p>', ''),
(68, 49, 1, 'al huda homestay temerloh', '<p>bilik tidur = 4</p><p>bilikr air = 2</p><p>bilangan katil = 2 katil kelamin dan 3 katil single</p><p>bilangan tetamu = 10 orang ( tetamu muslim sahaja)</p><p>pemberian kunci hubungi pemilik</p><p>masa dafter 2pm/flexible</p><p>masa daftar keluar 12pm / flexible, boleh check out lewat jika tiada customer</p><p><br></p><p><b><u>ada disediakan kemudahan yang berikut di homestay</u>?</b></p><p>-sejadah\'</p><p>- telekong</p><p>- al quran</p><p>- yassin</p><p>-arah kiblat</p><p>-matsurat</p><p><br></p><p><b>ada desiakan kemudahan untuk bilik mandi?</b></p><p><b><br></b></p><p>- tuala</p><p>-sabun mandi</p><p>-shampoo</p><p>-ubat gigi</p><p><br></p><p><br></p><p><b>barang tambahan</b></p><p>- toto</p><p>-selimut</p><p>-bantal</p><p><br></p>', ''),
(69, 50, 1, 'Asma Homestay ', '<p>Lokasi : No 15,Taman Chatin Court 1,Mentakab.</p><p>10 km dr bandar Temerloh@Kubang Gajah Waterpark</p><p>11 km dr Hospital Temerloh</p><p>2 km dr bandar Mentakab</p><p>5 km dr Star Mall</p><p>35 km dr Kuala Gandah (Gajah) @ Deerland</p><p><br></p><p>Jenis rumah : semi-D, 4 bilik 2 bilik air.</p><p>Sesuai utk 4 keluarga (10-15org)</p><p><br></p><p>Rumah dilengkapi dgn perabot,aircond di master bedroom,astro njoi,dapor,peti ais dan peralatan memasak,iron etc.</p><p><br></p><p>Inginkan penginapan yg selesa dgn harga yg berbaloi?</p><p>Sms/call/whatsapp/telegram:</p><p>019 6751845 @ 012 2751845</p><p><br></p>', ''),
(71, 52, 1, 'Homestay Malaysia Raya', '<p>Kami menerima penginapan, rombongan termasuk majlis perkahwinan. Tempat yg luas , parking berpagar, wifi, set perabot yang lengkap, termasuk penghawa dingin di ruang tamu dan bilik disediakan.&nbsp;</p><p><br></p><p>Kawasan terletak berhampiran dengan kemudahan pengangkutan awam (bandar tasik selatan) seperti Tbs Bts, lrt, mrt dan sebagainya. Lokasi homestay kami juga dekat dengan tempat-tempat menarik di sekitar Kuala Lumpur.</p><p><br></p><p>Homestay kami juga sesuai utk diadakan seminar dan kelas-kelas pengajian kecil atau kursus. Kami juga menyediakan sound system, projector, kerusi, meja dan lain2 kemudahan yg sesuai utk tujuan tersebut.</p>', ''),
(72, 53, 1, 'FandyRose Homestay', '<p>TAMAN PERUMAHAN BERKEMBAR SEMI-D SETINGKAT MENTAKAB TEMERLOH PAHANG</p><p>Homestay mula beroperasi pada 15 Mei 2015 di Taman Bukit Cermin Mentakab Pahang. Sejak dari itu, ia sering menjadi pilihan utama pengunjung kerana pelbagai kemudahan dan keselesaan optima disediakan kepada tetamu.</p><p><br></p><p>Lokasi yang strategik juga menjadikan homestay pilihan popular kerana terletak di pertengahan jalan utama antara Bandar Mentakab dan Bandar Temerloh. Pengunjung boleh pergi ke dua buah bandar sekaligus untuk pelbagai urusan dengan jarak hanya 5 hingga 10 minit sahaja.</p><p><br></p><p>Homestay ada Free WIFI dan 4 aircond. Lengkap perabut, boleh masak, ada peti ais, mesin basuh.</p><p>Ruang tamu luas ada aircond + kipas</p><p>Rumah ada 3 bilik tidur beraircond + kipas. Disediakan kelengkapan tempat tidur utk 10 org je. Klu dtg ramai dari tu, boleh bawa toto sendiri.</p><p>Ada 2 bilik air.. di master room tandas duduk + water heater</p><p>Di dapur bilik air, tandas cangkung.</p>', ''),
(76, 57, 1, 'Setiakasih Janda Baik', 'p', ''),
(81, 62, 1, 'D\'Skudai Rumah Melur', 'Lokasi berdekatan dengan Universiti Teknologi Malaysia. Rumah empat bilik tidur dan tiga bilik air dengan laman yang besar. Dilengkapi mesin basuh, keperluan memasak, microwave dll.', ''),
(90, 71, 1, 'Izzat Homestay Cameron Highlands', '<p>&lt;p&gt;terletak di sungai besi&lt;/p&gt;&lt;p&gt;berdekatan dengan bukit jalil dan kuala lumpur&lt;/p&gt;&lt;p&gt;hanya dngan menaiki Lrt &lt;/p&gt;&lt;p&gt;berdekatan dengan stesen erl ktm&lt;/p&gt;&lt;p&gt;banyak kedai makan sedap disini&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;</p>', ''),
(92, 73, 1, 'Homestay Mama', 'p', '06'),
(95, 79, 1, 'Teratak Kapten Rosli (Rumah Induk)', '<p>Lokasi terletak di Lenggong, Perak dan berdekatan dengan Tasik Raban. </p><p>Bukan hanya dilengkapi dengan bilik-bilik challet, juga dipenuhi dengan fasiliti lain seperti</p><p>Captain Rosli Lodge & Cafe,  Jeti Kapten Rosli, yang mana pengunjung boleh mengelilingi Tasik Raban menaiki Cruise Capten Rosli Cabin. Aktiviti lain,</p><p>pengunjung boleh ke Pulau Uji Pendek untuk berkhemah dan memancing udang galah, juga disediakan pakej melancong ke sekitar Lenggong 2019. </p><p><br></p><p>1. Rumah induk berharga RM280.00</p><p>2. Rumah Kecil Aircond RM100.00</p><p>3. Rumah Kecil Kipas RM80.00</p><p><br></p><p>Juga boleh seja vague RM500 sehari.</p>', '05'),
(96, 76, 1, 'The Nest Genting Klang Setapak', '<p>NEAR TO </p><p> </p><p>ZOO NEGARA 10KM </p><p>TAR COLLEGE 5KM </p><p>LRT STATION WANGSA MAJU 3KM </p><p>Hospital columbia 1km <br></p><p>Aeonbig 1kmtest <br></p><p>JPJ wangsa Maju 2km </p><p> </p><p>More information </p><p>KLCC 7 KM </p><p> </p><p>FACILITIES : </p><p>Level 6 </p><p> </p><p>Covered Kiddies Play Station </p><p>Reflexology </p><p>Aerobic Room  </p><p>Meditation Deck </p><p>Pool Deck with Lounge Chai (Website hidden by Airbnb) Floating Gazebos </p><p>Kids Pool with Wet apparatus and Water Curtain </p><p>BBQ Pavilion with 2 BBQ Pits </p><p>Herbs Garden </p><p>Multipurpose Hall  </p><p>Level 21 </p><p> </p><p>Sky Pool  </p><p>Sky Garden with Water Features and BBQ Pit </p><p> </p><p>The space </p><p> </p><p>Peaceful </p><p>Low density </p><p>Guarded and gated </p><p> </p><p>Guest access </p><p> </p><p>Sky pool </p><p>Facing main road </p><p>Easy accss by public transport </p><p> </p><p>Interaction with guests</p>', ''),
(99, 80, 1, 'D\'Manggis ', '<p>D\'Manggis merupakan sebuah villa mewah yang mempunyai ruang tamu, 4 bilik tidur, dapur, loteng (ruang tidur untuk 10 orang) yang lengkap dengan perabot.  Juga mempunyai kolam renang peribadi, dapur untuk memasak dan lapangan BBQ.</p><p>Terletak di Janda Baik yang jaraknya kira-kira 52km / 45 minit pemanduan dari Kuala Lumpur, D\'Manggis @ Janda Baik sememangnya sebuah destinasi yang luar biasa baik untuk mendapatkan udara yang nyaman, suasana yang tenang dengan deruan air sungai mengalir yang menyegarkan segenap deria. \r\n</p><p>\r\n</p><p>Berada dipuncak bukit dengan pandangan memukau mata persis sebuah lukisan indah ditambah dengan kedinginan suhu di DManggis ini juga membuatkan ia menjadi destinasi pilihan untuk lari dari kepanasan kota.  \r\n&nbsp; Merupakan lokasi yang sempurna bagi anda yang sudah tidak sabar-sabar ingin menyelamatkan diri dari genggaman hidup di ibu negara.&nbsp;&nbsp;</p><p>\r\n</p><p>Juga banyak aktiviti boleh dibuat disekitar antaranya, mandi manda di sungai / air terjun, memanah, menunggang ATV / menaiki 4x4 ke hutan dan jungle tracking.  Lokasinya juga berdekatan dengan Genting Highland dan Bukit Tinggi.</p><p>Kami yakin! dengan menginap di D\'Manggis, anda dapat melupakan dan melepaskan segala tekanan dan beban yang tersimpan.</p><p><br></p>', '05'),
(103, 85, 1, 'Zol Chalet', '<p>Zol Chalet terletak di Jus Permai Selandar Melaka.&nbsp; Sebuah chalet suasana kampung yang lengkap dengan kolam renang peribadi, dewan makan serta dapur untuk memasak dan ruangan BBQ.&nbsp; Terdapat 6 buah bilik (pondok kecil) yang dilengkapi dengan penghawa dingin, katil, tilam dan bantal yang sangat selesa serta bilik air dan tandas.&nbsp;&nbsp;</p><p>Bagi kaki pancing, dihadapan chalet terdapat kolam pancing ikan air tawar.</p><p>Lokasinya hanya 30 minit dari Bandar Melaka dan 30 minit ke Bandar Muar.</p><p>Bagi penggemar asam pedas, terdapat sebuah restoran kampung yang menyajikan asam pedas yang sangat sedap.</p><p>Berdekatan dengan Kolej Komuniti dan Institut Latihan Perindustrian.</p><p>Ayuh rasai sendiri menginap di ZOL CHALET!</p><p><br></p>', '05'),
(104, 86, 1, 'Zol Homestay', '<p>Homestay 3 bilik yang terletak di Kampung Jus Permai, Selandar Melaka.</p><p>Berdekatan dengan Institute Latihan Perindustrian Selandar dan Kolej Komuniti Selandar.</p><p>30 minit dari Bandar Melaka dan 30 minit ke Bandar Muar.</p><p>Bagi penggemar asam pedas Melaka, terdapat sebuah restoran berdekatan yang mengidangkan menu tersebut. Sangat enak!</p><p>Jemput datang dan rasai sendiri keindahan suasana kampung yang nyaman!</p>', '05'),
(105, 87, 1, 'Homestay Serambi Iman', '<p>Rumah teres dua tingkat yang mempunyai 3 bilik tidur dan 2 bilik air yang lengkap dengan perabot.&nbsp; Dikelilingi banyak kemudahan asas seperti surau, kedai-kedai dan restoran.</p><p>Hanya 15 minit ke Pusat Bandar Kuala Lumpur, ianya berhampiran dengan Pusat Reakriasi FRIM, Taman Metropolitan, Taman Botani dan Batu Caves.</p><p>Ia juga berhampiran dengan Hospital Selayang, Mydin, Selayang Mall, Jaya Grocer, Family Mart,&nbsp; Pasar Borong dan NSK.</p><p><br></p>', '05'),
(106, 88, 1, 'PENGKALAN CHEPA KOTA BHARU BAUNG HOMESTAY', '<p>HOMESTAY BETWEEN KOTA BHARU AIRPORT AND KOTA BHARU TOWN</p><p>Assalamualaikum semua.. sedikit info mengenai kemudahan yg ada di homestay kami.. \r\n</p><p>- mempunyai 4 bilik.. 3bilik air</p><p>-penghawa dingin utk setiap bilik\r\n</p><p>-pemanas air disediakan di bilik air tgh.\r\n</p><p>-dapur\r\n</p><p>-rice cooker\r\n</p><p>-peti sejuk\r\n</p><p>-cerek elektrik\r\n</p><p>-mesin basuh\r\n</p><p>-tv(saluran njoi)\r\n</p><p>-iron</p><p>-Penginapan berhampiran dengan Bandar Kota Bharu dan Pengkalan Chepa (Airport)\r\n</p><p>-Penginapan yang berkonsepkan suasana sekeliling yang tenang \r\n</p><p>( Kampung dalam Bandar)\r\n</p><p>-5 minit dengan Airport Pengkalan Chepa ( Kota Bharu Airport)\r\n</p><p>-5 minit dengan restoran makanan segera (KFC , MCD, PIZZA, MARRY BROWN)\r\n</p><p>-5 minit Maktab Penguruan Kota Bharu, MRSM Pengkalan Chepa, Kolej KIST, Universiti Malaysia Kelantan (UMK)\r\n</p><p>-10 minit dengan pusat Bandar Kota Bharu.\r\n</p><p>-10 minit dengan Pasar Besar Siti Khadijah\r\n</p><p>-15 minit dengan Pusat Jualan Wakaf Che Yeh KB Mall,Mydin\r\n</p><p>-15 minit dengan Bandar Kubang Kerian (HUSM)\r\n</p><p>-15 minit dengan Pantai Sabak\r\n</p><p>-20 minit dengan Pantai Cahaya Bulan (PCB)\r\n</p><p>-25 minit dengan Pantai Irama, Bachok\r\n</p><p>-30 minit Tok Bali, Jeram Pasu,Pantai Bisikan Bayu</p>', '06'),
(107, 89, 1, 'Niks Homestay Kok Lanas', '<p><b>Niks Homestay Kok Lanas menyediakan penginapan Selesa, Bersih, Murah untuk keperluan tuan/puan!</b></p><p><font color=\"#0000ff\"><b>KEMUDAHAN</b></font></p><p>-Rumah teres setingkat</p><p>-3 bilik tidur (2 bilik aircond+kipas, 1 bilik kipas)</p><p>-2 katil queen, 2 katil single</p><p>-2 bilik air</p><p>-TV astro NJOI</p><p>-Tuala/selimut setiap bilik</p><p>-Iron+Board, sejadah, almari, toto</p><p>-Paip air sinki bertapis</p><p>-Cerek elektrik, pembakar roti</p><p>-Mesin basuh auto, Peti Ais</p><p>-Sofa, meja makan</p><p>-Pinggan mangkuk</p><p>-indoor game (catur, dam)</p><p><font color=\"#0000ff\"><b>LOKASI STRATEGIK</b></font></p><p>-500m kolej komuniti kok lanas</p><p>-1km politeknik kota bharu</p><p>-50m kolej tahfiz sains nurul aman, kok lanas</p><p>-5km kolej matrikulasi, 2km kem desa pahlawan</p><p>-1km Pasaraya Econsave, 7Eleven</p><p>-1km McD, Pizza Hut, KFC 24jam dan pelbagai restoran/kedai makan masakan panas</p><p>-ATM MBB, BIMB, RHB, BSN, Muamalat dan pelbagai kemudahan lg dlm radius 2km</p><p>-25min Wakaf CheYeh, Kota Bharu</p>', ''),
(108, 94, 1, 'Ridha Apartment', '<p>Deskripsi Ridha Apartment</p><p>Unit apartment 3 bilik di tingkat 2</p><p>lift available</p><p><br></p><p>Bilik 1st</p><p>Katil queen 1</p><p>Meja solek</p><p>Rak towel</p><p>Almari baju</p><p>Air-conditioned</p><p><br></p><p>Bilik 2nd</p><p>Katil single</p><p>Rak towel</p><p>Katil queen</p><p><br></p><p>Bilik 3rd</p><p>Katil single 2</p><p>Rak towel</p><p><br></p><p>Bilik air 1&2</p><p><br></p><p>Dapur</p><p>Dapur gas</p><p>Rice cooker</p><p>Kettle</p><p>Meja makan</p><p>Pinggan mangkuk sudu garfu</p><p>Rak pinggan</p><p>Penapis Air</p><p>Peti sejuk</p><p>Periuk dan kuali dan sudip</p><p><br></p><p>Ruang tamu    </p><p>Sofa</p><p>Tv dan MYTV basic</p><p>Jam solat</p><p>Aircond</p><p><br></p><p>Extra</p><p>Sejadah</p><p>Mesin basuh</p><p>Toto</p><p>Bantal extra</p><p>Tong sampah ada 4 dlm rumah</p><p>Plastik sampah extra</p><p>tong gas pun ada</p><p>Taman permainan pun ada</p>', ''),
(110, 96, 1, 'Homestay Tambun ( Nina Homestay )', '<p>Tambun Homestay ( Nina Homestay ) merupakan sebuah rumah teres 2 tingkat dan mempunyai 4 bilik.. Homestay ini juga disediakan perlbagai kemudahan seperti air cond pada setiap bilik, heater dalam setiap bilik air dan 1 tandas berkonsep OKU.. Lokasihomestay ini juga amat strategik kerana berdekatan dengan Lost World Of Tambun, Movie Animation Park Studio (MAPS), Stadium Perak, hospital, pusat pengajian, balai polis Tambun, Giant Tambun.. Tetamu juga akan berasa selesa kerana ruang parking yang luas, ruang tamu dilengkapi TV led berAstro, dan kelengkapan asas lain seperti dapur, peralatan memasak, bread toaster, microwave, sejadah, mesin basuh, peti sejuk, seterika.. Homestay Tambun amat sesuai untuk keluarga yang inginkan keselesaan kerana kemudahan yang telah disediakan dan lokasi kami amat berdekatan dengan lokasi percutian di Tambun..</p><p>Ingat Tambun, ingat Homestay Tambun kami ya!</p><p><br></p><p>#Tambun Homestay#</p><p>- Bilik Utama</p><p>Aircond, kipas siling, katil king, TV dan almari baju, bilik air dilengkapi heater.</p><p><br></p><p>- 2 buah Bilik atas</p><p>Aircond, kipas siling, katil queen, almari baju, bilik air berkongsi dilengkapi heater.</p><p><br></p><p>- 1 bilik bawah</p><p>Aircond, Kipas siling, almari baju dan katil single</p><p><br></p><p>-Ruang Tamu</p><p>Kipas Siling, TV led , Astro njoi, Sofa</p><p><br></p><p>- Ruang Dapur</p><p>Bread toaster, microwave , Dapur, peralatan memasak</p><p>Sinki dan pinggan mangkuk</p><p>Disediakan serbuk teh, gula dan minuman 3 in 1</p><p><br></p><p>- Ruang Makan</p><p>Meja Makan 6 kerusi, Peti sejuk dan kipas</p><p></p><p>- Tandas</p><p>2 tandas duduk yg selesa</p><p>1 tandas duduk berkonsepkan OKU</p><p></p><p>- Disediakan</p><p># 4 helai sejadah</p><p># Seterika dan Iron board</p><p># Sabun Mandi</p><p># Washing Machine</p><p></p><p>- Parking</p><p>Parking yg luas. Boleh memuatkan 2 buah kenderaan.</p><p>Dihadapan rumah boleh memuatkan beberapa buah kenderaan</p><p></p><p>- Berdekatan</p><p><br></p><p>* Lost World Of Tambun ( 7 minit )</p><p>* Movie Animation Park Studio (MAPS) ( 14 minit )</p><p>* Giant Tambun ( 7 minit )</p><p>* Balai Polis Tambun ( 4 minit )</p><p>* Politeknik Ungku Omar ( 9 minit )</p><p>* Maktab Perguruan Kinta ( 14 minit )</p><p>* Kolej Kesihatan Ulu Kinta ( 20 minit )</p><p>* Pantai Puteri Hospital ( 7 mint )</p><p>* KPJ Hospital ( 7 minit )</p><p>* Hospital Besar Ipoh (15 minit )</p><p>* Stadium Perak ( 15minit)</p><p><br></p>', '06'),
(112, 98, 1, 'The Cozy & Luxurious', '<p>Brand new and luxury condo which close to LRT station Sri Rampai which only take 15 mins to KLCC.</p><p>Only 5mins walking to Sri Rampai LRT station & Wangsa Walk (shopping mall)</p><p>Exclusive luxury property, 3 rooms (master bedroom comes with its own attached bathroom ,storage tank-type water heater, Aircond, ceiling fan and a wardrobe). </p><p>There are 2 unit Airconds and 2 unit ceiling fans at the living room. With a spacious living room and city view.</p>', '05'),
(113, 99, 1, 'Aneesa Guest House', '<p>Stong Waterfall a.k.a Jelawang.</p><p>Waterfall is one of the tallest waterfalls in Peninsular Malaysia.</p><p> It can be seen from the roadside in Dabong.</p><p> From KL you take the road from Kuala Lipis to Gua Musang. Then use road D241 to Dabong. </p><p>Clear signboards lead to the Park.</p><p>This guesthouse only 3.5km away from stong waterfall and 7km from Dabong railway station.</p>', '05'),
(114, 100, 1, 'Aisyah Homestay 1B Condo Kota Kinabalu Sabah', '<p>Mengapa perlu menginap ke hotel jika anda boleh berjimat bercuti bersama keluarga atau kawan-kawan di homestay yang selesa dan cantik, serba lengkap, memuatkan 6-8pax; Aisyah Homestay 1Borneo Condo Kota Kinabalu Sabah jawapannya.</p>', ''),
(115, 101, 1, 'A&A Homestay@KLIA', '<p>A&A Homestay KLIA terletak di Taman Indah KLIA Bandar Baru Salak Tinggi.<br></p><p>A&A Homestay@KLIA menawarkan penginapan yang selesa, bersih, murah serta ruang halaman yang luas untuk anda yang ingin berehat santai bersama keluarga.</p><p>\r\n</p><p>Lokasi rumah yang sangat menarik ini yang mana berdekatan dengan Stesen ERL Salak Tinggi, KLIA, KLIA2, Litar F1 Sepang dan Nilai 3.\r\n Kedudukan yang sangat strategik dan bersempadan dengan lokasi tumpuan seperti Putrajaya, Cyberjaya, Bangi,Kajang, Nilai, Banting. Lokasi homestay ini juga amat sesuai bagi anda yang mempunyai urusan menghantar jemaah haji atau umrah, mesyuarat, majlis konvokesyen, majlis perkahwinan, percutian, reunion dan sebagainya.</p><p>\r\nMaklumat & Kemudahan</p><p>\r\n</p><p>Rumah Teres semi D setingkat+laman utk BBQ\r\n</p><p>Ruang parking kereta\r\n</p><p>\r\n</p><p>Jarak ke lokasi tumpuan:</p><p>\r\nKLIA,KLIA2 Airport (20 min)</p><p>F1 circuit (20min)\r\n</p><p>ERL Salak tinggi (5min)\r\n</p><p>Mitsui Outlet (10min)\r\n</p><p>Tabung Haji KLIA (10min)\r\n</p><p>Masjid KLIA (10min)\r\n</p><p>Public Facilities,shop,clinic,fuel station,restaurant (5min)\r\n</p><p>Shopping area (Nilai 1, 3) (25min)\r\n</p><p>\r\n</p><p>Kawasan untuk membeli belah:</p><p>Tesco Nilai\r\n</p><p>Giant Nilai\r\n</p><p>Nilai 3\r\n</p><p>Mitsui\r\n</p><p>MyDin Nilai\r\n</p><p>Aeon Nilai</p><p>Kipmall Kota Warisan</p><p>\r\n</p><p>Kawasan Universiti berhampiran:-\r\n</p><p>Inti College\r\n</p><p>Nilai University\r\n</p><p>USIM\r\n</p><p>IIUM\r\n</p><p>Manipal Universiti\r\n</p><p>IKTBN\r\n</p><p><br></p><p>Kemudahan2 lain yang  berhampiran :\r\n</p><p>- Klinik Kesihatan Salak\r\n</p><p>- Nilai Medical Centre\r\n</p><p>- Klinik Nur Qaseh, maternity\r\n</p><p>- Balai polis IPD Sepang\r\n</p><p>- Kedai runcit\r\n</p><p>- Kedai serbaneka (7E)\r\n</p><p>- Restoran melayu\r\n</p><p>- Restoran mamak\r\n</p><p>- Stesen minyak \r\n</p><p>- Bank/ATM\r\n</p><p>- KFC\r\n</p><p>- Pizza Hut\r\n</p><p>- Mc Donald (Kota Warisan, Bdr Baru Salak Tinggi, Nilai, KLIA)\r\n</p><p>- Stesen komuter Nilai\r\n</p><p><br></p>', ''),
(116, 102, 1, 'Country Garden Danga Bay Suite ', '<p><b>5star Living Home Country Garden Danga Bay</b></p><p><br></p><p>Apartment 2bedroom 1bathroom</p><p>1 Queen bed</p><p>2 Single bed</p><p>2 floor mattress&nbsp;</p><p><br></p><p>Rumah lengkap</p><p>- Air conditioner&nbsp;</p><p>- Washing machine&nbsp;</p><p>- Microwave&nbsp;</p><p>- Water heater&nbsp;</p><p>- Kettle</p><p>- Hairdryer&nbsp;</p><p>- Wifi</p><p>- Astro</p><p>- Kitchen utensils&nbsp;</p><p>- Fridge</p><p>- Gas stove</p><p><br></p><p>Facilities&nbsp;</p><p>- Swimming pool&nbsp;</p><p>- Gymnasium&nbsp;</p><p>- Kids room&nbsp;</p><p>- Study room</p><p>- Playgrounds&nbsp;</p><p>- Tennis Court&nbsp;</p><p>- Badminton Court&nbsp;</p><p>- Bowling(booking)</p><p>- Movie hall (booking)</p><p><br></p><p>*free parking</p><p>*cooking allowed&nbsp;</p><p>*available for long stay ( a week or a month) with discounts&nbsp;</p><p><br></p><p>Area</p><p>- 15min to CIQ</p><p>- 15min to Legoland</p><p>- 10min to Aeon bukit indah</p><p>- 10min to Angsana</p><p>- 15min to Paradigm mall</p><p>- 15min to JBCC</p><p>- 5min to Hospital</p><p>- 5min to Istana Johor</p><p>- 3min walking distance restaurants&nbsp;</p><p>- 3min walking distance to beach</p><p>- 3min walking distance to tiki bar</p><p><br></p><p>Smoking only at balcony</p>', ''),
(117, 103, 1, 'BigSpaze Family Home Cameron Highland ', '<p>BigSpaze Family Vacation Home</p><p>2bedroom 2bathroom</p><p><br></p><p>Cooking allowed</p><p>Smoking only at balcony</p><p><br></p><p>** Microwave</p><p>** Rice Cooker</p><p>** Fridge</p><p>** Electric kettle</p><p>** Astro</p><p>** Big Flat Screen TV</p><p>** Sofa</p><p>** Centralize water heater</p><p><br></p><p>*Bathroom 1</p><p>- Queen size bed</p><p>- Wardrobe</p><p>- bathroom attached</p><p><br></p><p>*Bathroom 2</p><p>-Queen size bed</p><p>- Wardrobe</p><p>- 2 folding single bed</p><p><br></p><p>Suitable for 6pax adult</p>', ''),
(118, 104, 1, 'Homestay Near Chenang Langkawi', '<p>Berhajat nak mai Langkawi?</p><p><b>Nuryns Traveldea</b> sebuah syarikat berdaftar membantu anda mencari homestay, van dan kereta sewa dengan harga yang ideal.</p><p>Anda mungkin mempunyai masa untuk servey seberapa banyak pakej di Langkawi, tetapi adakah anda mampu mendapatkan pakej yang bersesuaian?.</p><p>jom kami bantu anda.</p><p>wasap.my/60175702769</p><p><br></p>', ''),
(119, 105, 1, 'Homestay Fasya', '<p>3 bilik tidur</p><p>2 bilik air</p><p>Aircond (bilik 1 dan 2)</p><p>1 lot parking</p><p>Berdekatan pasar dan kedai</p><p>fully furnished</p><p>1 km dari HUKM dan Midvalley</p><p>2 km dari Times Square dan Bukit Bintang</p><p>5 KM dari Bandaraya KL</p>', 'Homestay'),
(120, 106, 1, 'Rumah Tamu ZMS Famili ', '<p>Rumah tamu 5 Bilik, 3 bilik air dan Tandas, 3 Ruang Tamu luas, dapur dan kelengkapan lengkap, sesuai untuk percutian bersama keluarga besar.. Dilengkapi penghawa dingin dan kipas serta parking turut disediakan.. Boleh memuatkan 3 ke 4 buah keluarga dalam satu masa.. Lokasi strategik antara 3 daerah, HuluTerengganu, Marang dan Kuala Terengganu..</p>', ''),
(121, 107, 1, 'SriKota Hom2stay At Kota Bharu', '<p>Sebuah penginapan yang selesa. selamat dan strategik di Kota Bharu dengan harga yang berpatutan.</p><p> Srikota Homestay sangat ideal untuk seisi keluarga. Penginapan di SriKota Homestay seperti berada di rumah sendiri.</p>', ''),
(122, 108, 1, 'SRGD SG RAMAL DALAM BBBANGI', '<p>Homestay SRD SG RAMAL DALAM terletak di KAMPUNG SUNGAI RAMAL DALAM KAJANG BERSEBELAHAN BANDAR BARU BANGI<br></p><p><br>Menawarkan penginapan yang selesa, bersih, murah serta ruang halaman yang luas untuk anda yang ingin berehat santai bersama keluarga.<br><br>Lokasi rumah yang sangat menarik ini yang mana berdekatan dengan BB BANGI UPM UKM UINTEN KAJANG PUTRAJAYA SERDANG</p><p>Kedudukan yang sangat strategik dan bersempadan dengan lokasi tumpuan seperti Putrajaya, Cyberjaya, Bangi,Kajang, Nilai, SEREMBAN SEMENYIH . Lokasi homestay ini juga amat sesuai bagi anda yang mempunyai urusan menghantar jemaah haji atau umrah, mesyuarat, majlis konvokesyen, majlis perkahwinan, percutian, reunion dan sebagainya. <br><br>Maklumat & Kemudahan <br><br>RUMAH APARTMEN<br><br>Ruang parking kereta<br><br>Jarak ke lokasi tumpuan: <br><br>KLIA,KLIA2 Airport (20 min) <br><br>Public Facilities,shop,clinic,fuel station,restaurant (5min)<br><br>Shopping area (Nilai 1, 3) (25min)<br><br>Kawasan untuk membeli belah: <br><br>Tesco <br>Giant </p><p>ECONSAVE</p><p>KIPMALL <br></p><p>PKNS<br>Nilai 3<br><br>MyDin SEKYEN 7 B BANRU BANGI<br><br>Kawasan Universiti berhampiran:-<br><br>UNIKL<br><br>UKM</p><p>UPM<br><br>UNITEN<br><br>Kemudahan2 lain yang berhampiran :<br></p><p><br></p><p>HOSPITAL SERDANG</p><p>HOSPITAL KAJANG<br></p><p><br>Klinik Kesihatan <br><br>Klinik ANNur<br></p><p><br>Balai polis <br><br>Kedai runcit<br></p><p>Kedai serbaneka (7E)<br><br>Restoran melayu<br><br>Restoran mamak<br><br>Stesen minyak<br><br>Bank/ATM<br><br>KFC<br></p><p>Pizza Hut<br><br>Mc Donald <br></p><p><br>Stesen komuter <br><p><br></p></p>', ''),
(123, 109, 1, 'Regalia Suites', '<p>Homely Regalia studio unit located within walking distance to PWTC and Sunway Putra Mall. The place is well known amongst local and overseas tourists for its wonderful view from its infinity pool facing KLCC and KL Tower.</p>', '04'),
(124, 110, 1, 'Iman Homestay', '<p>Sebuah homestay yang terletak di Kampung Sungai Apong Sabak Bernam Selangor. </p><p>Suasana kampung yang permai terletak berhampiran pantai.</p><p>Berdekatan Institut Pengajian Tinggi (Politeknik Sabak Bernam, Pusat Latihan Dakwah - ILDAS dan Institut Perakaunan)</p><p><br></p>', '05'),
