(127, 113, 1, 'Homestay Melaka', '<p>Jom ke Melaka Bandaraya Bersejarah</p><p><br></p><p>ZULHomestay Melaka 88A</p><p>Lokasi homestay yang sangat STRATEGIK serta berdekatan dengan EXIT TOLL AYER KEROH.&nbsp;</p><p><br></p><p>#FREE</p><p>-Tea</p><p>-Gula</p><p><br></p><p>Kemudahan yang disediakan:</p><p> Ruang Tamu  - Sofa, Meja kopi, LCD TV&nbsp; &nbsp; &nbsp; Astro Njoi, kipas</p><p> Bilik 1 - Queen, Air Cond &amp; Kipas</p><p> Bilik 2 - Queen, Air Cond &amp; Kipas</p><p> Bilik 3 - Double Single &amp; Kipas</p><p> Bilik 4 - Single Bed &amp; Kipas</p><p> 2 Bilik Air&nbsp;</p><p>~ Mesin Basuh Automatik</p><p>~ Peti Ais &amp; Meja Makan</p><p>~ Induction cooker &amp; Kelengkapan Alatan memasak</p><p> Iron + Iron Board</p><p> Rice Cooker, Kettle, Microwave</p><p> Telekung &amp; Sejadah</p><p> extra 1 Toto &amp; 4 pillows</p><p> BBQ set</p><p>*Parking muat 4 buah kereta</p><p><br></p><p>HUBUNGI KAMI UNTUK DAPATKAN&nbsp;</p><p><br></p><p>-Ina 0129563695</p><p>-Zul 0199707598</p><p><br></p><p>Visit our page&nbsp;</p><p>&nbsp;https://www.facebook.com/homestaymelaka88A/</p>', 'Sam'),
(128, 114, 1, 'T\'Tiara Homestay', '<p>D\' Alamat:</p><p><br></p><p>[ ] No 11, 2/2 Taman Tiara Perdana Simpang Renggam , Johor, sedia untuk tempahan.</p><p><br></p><p>[ ] Kemudahan yg disediakan:</p><p>- 3 bilik tidur (master room bilik aircond)</p><p>- 2 bilik air dan small office</p><p>- Kemudahan Aircond</p><p>- dapur masak besar,pembakar roti, pemanas air,seterika.</p><p>- Astro NJOI</p><p>- Berdekatan restoran mamak, kedai runcit, kolam mancing udang</p><p>- berdekatan dengan Econsave dan dll</p><p>[ ] Deposit hanya RM 50 sebelum masuk</p><p>[ ] Untuk tempahan boleh hubungi :</p><p>019-7292891(adam)</p><p>019-7292817(mira)</p>', 'Homestay'),
(129, 115, 1, 'Cahaya Pelangi Homestay Kluang', '<p><b>JOM BERMALAM DI CAHAYA PELANGI HOMESTAY :-</b></p><ul><li>LOKASI DI BANDAR KLUANG</li><li>SIMPANG KE HOMESTAY BERDEPAN DENGAN SEK.MEN SRI PERDANA KLUANG</li><li>2 MINIT KE SHOPPING MALL ( KLUANG MALL & KLUANG PARADE)</li><li>2 MINIT JUGA KE LAMAN KREATIF KLUANG</li><li>RUMAH KOS RENDAH 2 TINGKAT</li><li>MEMPUNYAI 3 BILIK DI TINGKAT ATAS</li><li>MEMPUNYAI RUANG TAMU, DAPUR, 1 BILIK MANDI, 1 TANDAS DI TINGKAT BAWAH</li><li>DELIVERY KFC TERUS SAMPAI DI DEPAN PINTU HOMESTAY</li><li>BERHAMPIRAN KEDAI MAKAN, DOBI, 7 ELEVEN, BIG TEEN DLL.</li><li>UNTUK KETERANGAN LANJUT, SILA CALL O WHATSAPP 0136862345.</li><li>FIRST COME, FIRST SERVE !!!.. TQ</li></ul>', '03'),
(130, 116, 1, 'homestay d indah', '<div><span style=\"-webkit-text-size-adjust: 100%;\"></span><span style=\"-webkit-text-size-adjust: 100%;\">Bilik 1</span></div><div>katil queen, kipas dan aircond</div><div>Bilik 2</div><div>1 katil queen dan kipas</div><div>Bilik 3</div><div>2 katil single dan kipas</div><div>2 bilik air dan tandas</div><div>-Ruang menonton tv</div><div>-Ruang parking 2 buah kereta.</div><div>- 3 min ke AEON mall</div><div>- 7 min ke USIM dan valedrome nilai</div><div>-3 min Masjid Putra Nilai o</div><div>- 7min ke Nilai 3</div><div>-20 min ke KLIA</div>', ''),
(131, 117, 1, 'HOMESTAY GERIK BANDING', '<p>Kami menawarkan penginapan selesa dan harga berpatutan</p><p><br></p><p>(MUSLIM SAHAJA)</p><p><br></p><p>1 Master bedroom ada aircond dan 2 bilik. semua lengkap dengan almari (Toto dan bantal extra disediakan)</p><p>* 2 Bilik mandi</p><p>* Ruang Tamu/ TV dilengkapi aircond dan 3 sofa</p><p>* Parkir Berpagar</p><p>* Kelengkapan solat</p><p>* Peti Ais disediakan</p><p>* Alatan memasak disediakan</p><p>* Seterika</p><p>* Sabun mandi</p><p><br></p><p>Waktu Check in 2.00 petang/ Check out 12 tengah</p><p>hari(Boleh dirunding)</p>', ''),
(132, 118, 1, 'Villa Permai Homestay', '<p>Sebuah villa kampung yang terletak dikawasan sawah padi di Kampung Desa Permai, Parit 8 Sungai Panjang, Sungai Besar, Selangor.</p><p>Memiliki 9 buah bilik yang lengkap dengan perabot dan hawa dingin.</p><p>Saat tinggal disini, anda pastinya akan merasa kedamaian kampung hingga membuatkan anda lupa akan hiruk pikuk suasana kota.</p><p>Juga dilengkapi dengan kolam mandi untuk anak2 bermandi-manda dan bagi si ayah, pastinya parit dan saliran sawah pasti menjadi tumpuan untuk memancing.</p><p>Tuan rumah juga ada menyediakan aktiviti-aktiviti sampingan bergantung kepada permintaan.</p><p>Selamat datang ke Villa Permai.</p>', '05'),
(133, 119, 1, 'Homestay Ikhlas', '<p>Sebuah homestay taman yang terletak di Kepala Batas.</p><p>Dilengkapi dengan TV, katil, sofa, penapis air, dan ruangan kopi.</p><p>Berdekatan dengan kedai makan, hospital, Dewan Mellinium, Dewan MPC, Matrikulasi Kepala Batas dan Sekolah Menengah Al Irshad.</p><p>Lengkap dan Nyaman.</p>', '07'),
(134, 120, 1, 'Pilah Kontenastay', '<p>Pilah Kontenastay offers peaceful, cosy and comfortable accommodation with free parking space on site. Located 3 km or less 5 minutes away from Kuala Pilah Town.</p><p><br></p><p><br></p><p>Featuring a private entrance, this private Kontenastay offers 2 types of rooms 1)Leia\'s Cottage and 2)Luq\'s Kontena that comes with air conditioning, dining table and a living room with sofa bed. A fridge and electric kettle are also included. The private bathroom offers shower facility but no heater as the concept is back to nature.</p><p><br></p><p>A shared balcony/deck equipped with a 10-person rustic dining table made of a 100-year old cengal wood, its a time stopping laid back place to enjoy your meal facing a typical kampung garden with loads of fruit trees like durian, rambutan, jackfruit, duku langsat and many more!</p><p><br></p><p>We are also offering the accomodation with FREE WiFI.</p><p><br></p><p>BBQ pits for those wanna enjoy the nature during night time.</p><p><br></p><p>Pets like rabbit for kids and kelulut (stingless bees) to educate the guests.</p><p><br></p><p>Free parking</p><p><br></p><p>Breakfast and dinner upon request.</p><p><br></p><p>We also providing our own collection of Kuala Pilah Map just to cater your needs when you stay in Kuala Pilah and helps u in \'what to do in Kuala Pilah\'</p><p><br></p><p>At Pilah Kontenastay, the host can converse in Malay and English. Host can cook for special Negeri Sembilan by request only.</p><p><br></p><p>Activities such as bbq, bird watching, soursop farm, kelulut farm, swimming at waterfalls, and special kampung food factory can be arranged. Tours and transport services are available at a surcharge.The most ultimate activity that they offers guest by giving special Private Ice Theraphy Spa and massage at reasonable price.</p><p><br></p><p><br></p>', 'Sam'),
(135, 121, 1, 'Bandar baru bangi EVO SOHO', '<p><b>The space&nbsp;</b></p><p>De\'Happiness Home: A home far away from home</p><p><br></p><p>De\'Happiness Home is designed and decorated alike your home sweet home, we aim to maximize your happiness with a homestay experience with us. We truly believe that De\'happieness home is the best value accommodation choice in Bandar Baru Bangi based on what we provide to guests. The space is unique as it combines both comfort and accessibility to shops, grocery stores, parks, libraries, and many more. Guests will also have full access to apartment facilities such as:</p><p>i. Gym</p><p>ii. Swimming pool</p><p>iii. Playground</p><p><br></p><p>Find out why we are one of, if not the best reviewed and fastest growing Homestay in Bandar Baru Bangi as it has all that you need to feel right at home, from high speed WIFI. You can also do some light cooking as the kitchen is fully equipped with the necessary tools and utensils.</p><p><br></p><p><b>Summary&nbsp;</b></p><p>Comfy studio apartment in the newly completed Bangi EVO Apartments, on top of the EVO Shopping Centre, the newest accommodation-shopping mall hybrid in Bangi.</p><p><br></p><p>It is strategically located near many attractions:</p><p><br></p><p>More information</p><p>i. Bangi Sentral - hub for muslimah fashion and boutique cafes restaurant</p><p>ii. UKM&nbsp;</p><p>iii. UNITEN</p><p>iv. UPM</p><p>v. IOI City Mall</p><p>vi. Putrajaya</p><p>vii. Cyberjaya</p>', ''),
(136, 122, 1, 'SueHaz Homestay Arau', 'SUEHAZ Homestay ARAU<div><br></div><div>New comfortable, spacious, floor-mounted tiles throughout the house and fenced to ensure your privacy.</div><div>Moslem only.</div><div>strategic location because it is located between Arau town and Kangar town.</div><div>Located only: -<div>2 minutes Unimap Kubang Gajah branch 1km</div><div>5 minutes Kangar Town 3.4km</div><div>5 minutes Community Nurse College 3.9km</div><div>5 minutes IPG Perlis 4.6km</div><div>5 minutes Matrix Perlis 5.0km</div><div>5 minutes Uitm Arau 5.1</div><div>7 minutes Arau Town 6 km</div><div>7 minutes Cmart Arau 6km</div><div>8 minutes Hosp Kangar 6.8km</div><div>8 minutes Kangar bus station is 7.3km</div><div>9 minutes Giant Jayapura 8 km</div><div>15 minutes Kuala Perlis Jetty 18km (Straight Highway)</div><div>30 minutes of Grand Central Arcade Arcade 28KM</div><div>30 minutes Wang Kelian 34km</div><div>Nearest facilities (5-10 minutes away):</div><div>C-mart, Pizza Hut Delivery, Al-sagoff Yasmeen Nasi Kandar, Bank (Maybank BSN, Ambank, Bank Rakyat, Public Bank), Oil stations, State Mosques, various stalls, and train stations.</div></div>', '07'),
(137, 123, 1, 'Singgah Homestay BTP', '<p>Sebuah homestay yang terletak di Bandar Tasik Puteri, Rawang Selangor ini lengkap dengan perabot rumah dan sangat selesa.</p><p>Berdekatan dengan Batu Arang, hanya 40 minit ke Pusat Bandar Kuala Lumpur dan 30 minit ke Kuala Selangor yang mudah di akses dengan lebuhraya LATAR.</p><p>Homestay ini juga berdekatan dengan Hutan Lipur Kanching dan Templer Park Rawang, Fruit Valley, Kampung Kelip-Kelip dan Bukit Malawati Kuala Selangor.</p><p>Hanya 20 minit ke UNISEL.</p><p>Pada penggemar sukan golf, Kelab Golf Bandar Tasik Puteri juga hanya 5 minit dari Homestay ini.</p><p><br></p>', '05'),
(138, 124, 1, '3G Homestay', '<p>Sebuah rumah penginapan yang mempunyai <b>3 Bilik Tidur</b>  dan <b>2 Bilik Air</b>, </p><p><br></p><p><b>1 Bilik KatilQueen</b> size sesuai untuk 2 org yg dilengkapi penghawa dingin lengkap dengan 1 unit tandas, sejadah dan almari.</p><p><b>1 Bilik Katil Single</b> yg dilengkapi penghawa dingin, 1 unit tilam extra dan sejadah.</p><p><b>1 Bilik Katil Single</b> dilengkapi dengan 1 unit tilam extra dan sejadah juga 2 biji bantal extra.</p><p>Ruang dapur (termasuk dapur + peti sejuk, peralatan masak dan pinggan mangkuk.  Tong Gas boleh request.</p><p>Bagi ruang tamu pula dilengkapi dengan set sofa dan tv.</p><p>Sangat sesuai bagi mereka yang berkeluarga.</p>', '05'),
(139, 125, 1, 'kristal villa homestay', '<ul><li>very near kajang, bangi, and semenyih</li><li>3km to mrt kajang</li><li>5km to UKM</li><li>1km to downtown kajang.</li></ul><p><br></p>', ''),
(140, 127, 1, 'dorani homestay', '<p>Sebuah penginapan kampung dengan suasana tepi sawah yang tenang dan damai.</p><p>Ada menyediakan aktiviti-aktiviti kampung seperti memancing, menggagau ikan, bermain layang-layang dan menumbuk padi.</p>', '05'),
(141, 128, 1, 'D\'Hana Roomstay', '<p>Sebuah rumah Inap Desa yang yang terletak di Parit 1 Sungai Haji Dorani.</p><p>Terletak ditepi sawah padi dan dilengkapi dengan perabot.</p><p>Berdekatan dengan Pekan Sungai Besar.</p>', '05'),
(142, 126, 1, 'Homestay Zamora', 'text here', NULL),
(143, 129, 1, 'Izan Housestay', '<p>Rumah Inap desa yang terletak di Parit 16 Jalan Sungai Panjang Sungai Besar Selangor.</p><p>Mempunyai dua buah rumah yang lengkap dengan perabot sepert televisyen, sofa, katil dan tilam, dapur untuk memasak.</p><p>Dikelilingi oleh pokok-pokok durian, pulasan, manggis, dukong, mata kucing laksana sebuah dusun buah-buahan yang nyaman dan sangat selesa bagi bersantai dari kesibukan bandar.</p><p>Berhampiran anak sungai yang sesuai pada penggemar aktiviti memancing.</p><p><br></p><p><br></p>', '05'),
(144, 130, 1, 'Pelangi Homestay', '<p>Sebuah homestay dengan suasana kampung di kelilingi sawah padi terletak di Peket 20, Sungai Haji Dorani.</p><p>Persinggahan yang sangat ideal bagi mereka yang dalam perjalanan ke utara melalui jalan persekutun.</p><p>Berdekatan dengan kemudahan asas seperti masjid, restoran, kedai-kedai barangan keperluan dan stesen minyak Petronas.</p><p>Disediakan juga aktiviti-aktiviti riadah seperti berjoging dan berbasikal disekitar sawah padi juga memancing di tali air dan kolam.</p><p>Singgah dan nikmatilah sendiri keseronokan berada di sebuah kampung yang sebenar.&nbsp; Rasai pengalaman yang pasti tidak akan dapat dilupakan.</p>', '05');
